st/elegant style.<BR /><BR />You will have access to every part of the apt but I do have my personal belongings in the closet across from the bathroom. Please respect my things and this area. The complex itself has laundry onsite which I would be willing to help you access for a fee.<BR /><BR />I will be often available after 5pm on weekdays and all day on the weekend. I live on the floor below in the same building.<BR /><BR />The neighborh',0,1,2,45,33.4225,-111.953),('f19fa153-154e-440b-9f4b-debee403b0d2','2017-03-25 02:17:06','2017-03-25 02:17:06','c5bbe76a-87f0-44f8-8b4d-e805e6cd757c','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Beautiful Home 1 Mile from Downtown','Beautifu home just one mile from Downtown Naperville. Private bathroom oasis w/ rain shower & body jets. FREE Coffee/Tea, FREE wi-fi. Queen size REAL bed. Use of kitchen, off street parking, cable TV in shared space. Two outdoor decks, fire pit.<BR /><BR />Home is a tri-level home. Your room has a queen sized bed and is on the lower level away from the other bedroom\'s space. Your bathroom is across from your bedroom and will be yours to use during your stay.  Towels are included as are sheets, hangers, bedding (and extra bedding if necessary).  Hairdryer available. FREE Wifi available.<BR /><BR />The mid and lower levels of the home are available for you to use. There is a kitchen, living and family rooms as well as a dining room table, outdoor decks and a fire pit.  You will have access to the coffee maker, teapot, as well as all kitchen utensils and cookware. You will have some space in the refrigerator if you\'d like to purchase food for you to use. We also have a washer and dryer as',1,1,2,60,41.7744,-88.1741),('f25b307b-4285-4902-8305-8cf908eace7a','2017-03-25 02:17:06','2017-03-25 02:17:06','44e7a911-2c16-4dc0-ad68-9ae0412afc21','85651506-c13c-4c2f-9c79-8fbebc048e39','Cozy Tropical Bungalow','This private bungalow is steps from the wide Ewa Beach oceanfront. Great for water sports, sunbathing, splashing in the water and playing in the silky sand. Detached from the main house and in a completely independent dwelling, affording privacy and comfort during your stay on Oahu. No ocean view from the unit but is surrounded by lush foliage, and the beach is just a short 50 ft walk on a secluded path through the ferns out to the ocean/cabana. Private property and no public access is allowed.<BR /><BR />Full Kitchen, 2 dining tables for your comfort, one is indoors and one is outdoors on a covered patio surrounded by huge palms and lush ferns. Shuttered windows all around provide balmy breezes flowing all through the bungalow. King size bed with crisp linens, tiled step-in shower and all the beach supplies you will need for a great time. Tropical birds singing all day and the sound of the ocean waves will relax you during your stay at our serene and heavily forested beachfront proper',0,1,3,125,21.3139,-157.995),('ff46f903-411b-4a16-8e16-1aab7f00686c','2017-03-25 02:17:06','2017-03-25 02:17:06','1721b75c-e0b2-46ae-8dd2-f86b62fb46e6','30a890e4-a62c-44f9-abc0-07e2c74021da','The Rooming House in Old Bisbee','The Rooming House is a lot like the city in which it resides: quirky, cozy, inviting, communal, and experiential. It’s a safe and relaxing space for adventurers to sleep, spin records, talk, explore, and meet fellow travelers from all over the world.<BR /><BR />You will never stay anywhere like The Rooming House! This space was previously used to put up miners when they were working in town back in the heyday of Bisbee. It has a very cool set-up with lots of rooms, windows, wood floors and great accents. Complimentary coffee provided every morning! Charcoal grill also available for your use... Please note: This space can accommodate groups of up to six people. If you would like to book additional rooms, please send us a direct message and we can adjust your reservation accordingly!<BR /><BR />We will be here to answer any questions you may have; however, this space is definitely yours to enjoy. Full access to the kitchen, dining and living rooms while you\'re here. Wifi throughout, pass',1,1,2,70,31.444,-109.912),('ffcc9c22-759e-4418-b788-81eda89c2865','2017-03-25 02:17:06','2017-03-25 02:17:06','1da255c0-f023-4779-8134-2b1b40f87683','7771bbe9-92ab-46d1-a636-864526361d7d','Affordable room in the Marigny','Semi-private room in a cute and cozy shotgun house in the Marigny. 15 minute walk to the French Quarter, 12 minutes to Frenchmen St., 2 minutes to the Bywater. Located around the corner from a few restaurants, bars, a coffee shop, and grocery store.<BR /><BR />The house is a classic shotgun, a very common style of architecture for homes here in New Orleans. We rent three rooms in our house (see our profile for links to the other rooms). Each room is arranged one behind the other. You will be walking through all of our bedrooms to get to your room, and while you\'ll have your room to yourself, people will need to walk through it to access the kitchen, other bedrooms, backyard, and bathroom. Please look through our photos to see the \"blueprints\" of our house, this will give you an idea to how it\'s laid out.<BR /><BR />Your room is the third room in the house. It comes furnished with a built in bed, curtain for privacy, XL twin mattress, reading lamp, a chair, vanity with a large mirror,',1,1,1,40,29.9666,-90.0519);
