INSERT INTO `reviews` VALUES ('01a2c67a-b39d-4940-b910-a1cc3289557d','2017-03-25 02:17:07','2017-03-25 02:17:07','314b188e-990b-423e-ae63-f0199b8c2b17','150e591e-486b-48ee-be42-4aecba665020','Lovely haven on a quiet street.'),('0230dc18-a336-4ded-97ef-0fee0b4d6ea0','2017-03-25 02:17:07','2017-03-25 02:17:07','453b0b1c-6bf3-4e94-8265-082ef06ab85f','30a890e4-a62c-44f9-abc0-07e2c74021da','We loved our stay here! The cottage is gorgeous, comfortable, and has an extra touch you can tell. Our hosts were great and offered some awesome suggestions (like delicious Italian at Beppe\'s that made our night). Very relaxing and cosy, we would highly recommend!'),('0245460e-d3ed-4c21-b003-155bf74ce3d8','2017-03-25 02:17:07','2017-03-25 02:17:07','7ed82a23-cd4f-437b-be12-9c54e84281ef','61302be9-4b31-4be0-92fc-d0dda253e167','Great place! Very clean and nice...we were visiting family that lives near by and it was perfect...much better than the local motels. I have a feeling I will be fighting other members of my family to stay here again, everyone was very impressed. Thank you Lynn, Becky and Rebecca for your hospitality!'),('0278a560-6531-4a28-975f-f68bfc5fe0f9','2017-03-25 02:17:07','2017-03-25 02:17:07','ffcc9c22-759e-4418-b788-81eda89c2865','426624f6-84a9-4ec4-84f3-7655dc70e86e','I only stayed for one night but they were very accommodating with check in and check out times. I was greeted by their pups and barking, but don\'t be afraid they\'re actually really sweet. <BR />Although the idea of having your room accessed by others may be a turn off it wasn\'t that awkward hahaha<BR />In your bedroom they provide a curtain with the bed for extra privacy. It really does make your stay more comfortable and is a very nice detail that helped me sleep more comfortably at night. s a very urban and photogenic area. THANK YOU KATIE AND MATTHIJS ! '),('0363cc1f-6b48-426f-997b-e7b0b5f69195','2017-03-25 02:17:07','2017-03-25 02:17:07','cff8a023-eacb-4a38-a24f-a01fe9ddde18','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','As of the first week of march 2017 there were 165 reviews...all positive!...Cara and Bryan\'s KBCG lives up to every one of them...if there was a choice for 6 stars I would have...we have been coming to oahu for the past 17 years and this was easily the BEST vacation ever...Cara and Bryan are just good people and you absolutely cannot go wrong with Kailua Beach Cottage (URL HIDDEN) Ka Oi'),('03774280-2251-4721-ac2a-ae032b4e866f','2017-03-25 02:17:07','2017-03-25 02:17:07','645127dd-38b4-4fad-9950-57b3ce0a5301','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','Cameron and Sara are very friendly. They allow me to check in earlier to get a quick snap before my audition. I would be happy to be here again. You can cook, take shower and have a cozy bedroom. And their cat spent time with me. The cat is very friendly and lovely.'),('03d137bf-773f-4ae2-9fcb-fc388550636d','2017-03-25 02:17:07','2017-03-25 02:17:07','b180ad52-fe00-4040-97f9-9efdfc3d406d','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','This is a private entrance and space in a small RV.  Not really big enough for more than 2 persons.  Great family and close to I5, shops and supplies.'),('053c8af0-d775-4d20-b938-0834572e28cf','2017-03-25 02:17:07','2017-03-25 02:17:07','47b9ca37-915d-405d-861d-7dbf74559441','7771bbe9-92ab-46d1-a636-864526361d7d','Very clean and worth the money'),('056a429c-61f4-4a8b-a1fa-e4e129d6697f','2017-03-25 02:17:07','2017-03-25 02:17:07','60b77ea7-04c9-4b8a-b835-dc92c6aa196b','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Excellent location near one of the most iconic beaches in the world, Lanikai Beach.  The layout is very comfortable with a private space with all the amenities needed for an awesome stay, whether it\'s a day or a couple of weeks.  Josh and Josey were super-helpful and made sure I had all the info I needed to make the stay comfortable and cozy.  I gladly recommend this cottage to anyone looking for a great experience.'),('05a4063b-07b8-4ce4-b738-35217f82cfdc','2017-03-25 02:17:07','2017-03-25 02:17:07','453b0b1c-6bf3-4e94-8265-082ef06ab85f','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Bruce and Jennifer were great hosts, have a very cute, clean little cottage and were helpful when we were looking for adventures within the area. Great place to relax and unwind!'),('06084442-cd96-4daa-8b4d-8619ed8eae64','2017-03-25 02:17:07','2017-03-25 02:17:07','9c5a1e44-0090-464b-ac3b-89e0f65cc6e1','150e591e-486b-48ee-be42-4aecba665020','The house is pretty much terrible if you have european standards. Towels never clean, and when I say never I really mean never. The TV is always on 24h. Nobody to welcome you and help you at the airport. '),('06af6da4-137d-4a3b-bc3e-0ae33d687b47','2017-03-25 02:17:07','2017-03-25 02:17:07','0b96262f-2c72-464c-a182-8f58afde4288','00a11245-12fa-436e-9ccc-967417f8c30a','We came from Houston for my sons soccer tournament. This was our first Airbnb experience and it was great. Francis was a GREAT host, very accommodating, everything as described, easy in-easy out. Will definitely stay again when in Lafayette.'),('07278d85-44fa-43bf-a913-95babba2838a','2017-03-25 02:17:07','2017-03-25 02:17:07','6a78ec0c-8410-4cbf-a915-e697a3aa798d','d622edfa-fc35-4732-b5ec-a15d794267ec','Excellent, just book it'),('07456db9-4c5f-4b24-9c5b-55661da816b2','2017-03-25 02:17:07','2017-03-25 02:17:07','4ae40c33-23c9-47a9-b867-0a6d8f25fd8c','fa44780d-ac48-41ab-9dd0-ac54a15755cf','She was so accommodating and responsive ! Highly recommend and what a beautiful view '),('08429ff0-3eee-4094-8098-a8b69fda7b56','2017-03-25 02:17:07','2017-03-25 02:17:07','8835ba11-7757-45c6-9138-f7e2e4b5f80f','f33e2624-520b-4bc2-b6a0-190ee1d41855','We were supposed to stay at Jordan\'s place for one night, but ended up cancelling last minute since my boyfriend got sick in Honolulu and decided it was best to stay there and rest. Jordan was very flexible with our last minute changes, and he even offered us a different night to stay at his place. Unfortunately, this didn\'t happen since we had to fly out, but I will definitely want to visit his place the next time I visit Oahu. Thank you!'),('08738c2f-129b-4549-ae14-2316fa783b1c','2017-03-25 02:17:07','2017-03-25 02:17:07','66fb8e5d-2ad2-44be-8890-a13a9992f257','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','This place was great and Naomi was awesome. We had a last minute flight change and ended up getting to portland 3hrs before check-in. Luckily Naomi was super flexible and let us check in early. The house has a welcoming but hip vibe; has everything you need to make it feel like home. Also has some great places to eat just down the street and it is the perfect distance from downtown.'),('0ae495cf-67ef-470c-840e-b300e5f01f61','2017-03-25 02:17:07','2017-03-25 02:17:07','8835ba11-7757-45c6-9138-f7e2e4b5f80f','00a11245-12fa-436e-9ccc-967417f8c30a','The room is clean and good for 2 people. We unfortunately did not see Jordan who does not live in the house.<BR />'),('0b32b57e-a26c-4a0d-9442-65a7331825e0','2017-03-25 02:17:07','2017-03-25 02:17:07','4ae40c33-23c9-47a9-b867-0a6d8f25fd8c','d622edfa-fc35-4732-b5ec-a15d794267ec','Place had the most amazing view I\'ve seen since I\'ve used Airbnb. Location in convenient and there are a lot of shops, restaurants near by. Clean, AC, had a blast in the hot tub on the recreational floor. Would definitely recommend. Host was polite and quick to respond to my question '),('0b498860-3c30-447b-bd90-b3a3e92359b8','2017-03-25 02:17:07','2017-03-25 02:17:07','7354ea6c-3c0e-4800-aad8-708c29a6c067','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','My husband and I needed a place where we could sleep and shower while in Oahu,  since we wanted to do as much as we could out. Tex\'s place was just what we needed, a private room with a comfy queen bed and a bathroom we could use. The bathroom is shared with others in the house, but we did not mind since we only used it to take quick showers. We were comfortable during our 3 night stay. '),('0bbf090d-0f7e-4dc0-a2b8-4810c5ab7b66','2017-03-25 02:17:07','2017-03-25 02:17:07','9c7d3ecd-9592-4910-bd04-91c59e8350f1','d622edfa-fc35-4732-b5ec-a15d794267ec','My husband and I really enjoyed our night stay in Chris\' pool house: easy, clean and everything we needed.'),('0d1617cf-eca9-4eb8-b539-09d45f3af2b5','2017-03-25 02:17:07','2017-03-25 02:17:07','1385324e-d727-475c-ad30-f7dcb5afea02','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Tom is a wonderful host.  I have stayed several times and been very impressed with the quick communication and how accommodating Tom is.  I often make last minute requests and this has not been an issue.  I am comfortable and enjoy my stay.  Thank you very much for helping out when I have to stay late in the area and prefer not to drive back home.   '),('0da4f5fd-2fb8-40ed-8bfe-13aa3ee75cc0','2017-03-25 02:17:07','2017-03-25 02:17:07','0b96262f-2c72-464c-a182-8f58afde4288','00a11245-12fa-436e-9ccc-967417f8c30a','We really enjoyed staying in this little artist\'s nook. The place was clean, comfortable, cute, and right within walking distance to the Acadiana Center for the Arts and restaurants. Would definitely here again..'),('0db3d4f0-a35b-4930-9df2-5dccb70a333c','2017-03-25 02:17:07','2017-03-25 02:17:07','4703b2d8-e417-4243-a6f3-044fc06f020e','426624f6-84a9-4ec4-84f3-7655dc70e86e','Amelia was a WONDERFUL host and her house is very nice. Beautiful views off the balcony and beyond a great value. '),('0e3f3f44-0d47-4746-9b64-5b608aa18d11','2017-03-25 02:17:07','2017-03-25 02:17:07','4703b2d8-e417-4243-a6f3-044fc06f020e','f9b11370-f316-492c-92da-014d7bce7213','Amelia will make you feel at home and treat you like family. Don\'t look any further.'),('0e47910b-8bef-47bf-acfb-0363468f8dab','2017-03-25 02:17:07','2017-03-25 02:17:07','b2c8a4cd-6e80-48c3-a1fc-07f129ee2875','426624f6-84a9-4ec4-84f3-7655dc70e86e','The host canceled this reservation 4 days before arrival. This is an automated posting.'),('0f718be9-2d4f-4489-b8b8-dac1e5f61311','2017-03-25 02:17:07','2017-03-25 02:17:07','b4a927e4-9715-4cd2-9918-47491f97df3e','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Easy, clean, comfortable home with great touches. Slept well, and the room was comfortable. Much better than a hotel. '),('10315880-bba3-4a90-8ed5-c12f4fb73bac','2017-03-25 02:17:07','2017-03-25 02:17:07','ffcc9c22-759e-4418-b788-81eda89c2865','d622edfa-fc35-4732-b5ec-a15d794267ec','Overall, I had a nice stay. They were very friendly and easy to talk to.'),('1085af55-106b-47ee-befa-8b47225c8f79','2017-03-25 02:17:07','2017-03-25 02:17:07','4703b2d8-e417-4243-a6f3-044fc06f020e','d622edfa-fc35-4732-b5ec-a15d794267ec','Amelia was extremely friendly and helpful, the house/room was clean, well decorated, and in a convenient location. The bed was also super comfy! I would stay here again! '),('10c1e6a5-ce21-4c90-b73f-f180a1c210c3','2017-03-25 02:17:07','2017-03-25 02:17:07','314b188e-990b-423e-ae63-f0199b8c2b17','30a890e4-a62c-44f9-abc0-07e2c74021da','Great place, as advertised. Thank you, Christine and Chuck!'),('11b144c4-423c-42aa-b18b-7a0e26de7270','2017-03-25 02:17:07','2017-03-25 02:17:07','e551a4a6-7701-41de-be62-aae869888c78','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Smooth sailing from the beginning. Clear instructions for check-in. Always responded to my questions in a timely manner. A very gracious host and really wants the guests to have a great stay. Highly recommended!!'),('123824a5-b220-4917-bbea-6125b5d19ae0','2017-03-25 02:17:07','2017-03-25 02:17:07','60b77ea7-04c9-4b8a-b835-dc92c6aa196b','8394fd35-8a8a-479f-a398-48f53b4a6554','We loved our stay at the Kailua Cottage! Everything was very clean and decorated nicely, the a/c worked well and we loved having access to the beach chairs, towels and snorkel gear. Josey and Josh were so nice - they greeted us upon our arrival and were alway available if we needed something! Josey was super helpful in providing great recommendations for the area and checking in with us to ensure things were going well. We loved our stay and would definitely recommend staying here! '),('12f0c56e-8f1f-4f05-86fb-e1d5ccf8da60','2017-03-25 02:17:07','2017-03-25 02:17:07','6a78ec0c-8410-4cbf-a915-e697a3aa798d','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','Overall, we had a good stay! '),('12f53707-8644-4f5a-8af8-ac4bbcc1b56d','2017-03-25 02:17:07','2017-03-25 02:17:07','19ae5055-f503-499d-a64f-2bf7d92eff5b','00a11245-12fa-436e-9ccc-967417f8c30a','We had a great time at Joe\'s place. It was just the right size for us two and we liked the simple nature of the place. No extra frills, clean, and a quick uber ride to downtown. Thanks Joe!'),('13007e07-8a09-4d0e-ad26-7a90e7e166b2','2017-03-25 02:17:07','2017-03-25 02:17:07','b5880e7d-c4b7-497e-ac1a-12826327132f','150e591e-486b-48ee-be42-4aecba665020','Great location and really nice host. Highly recommended '),('13a80198-2b13-446d-a71f-869c013575fd','2017-03-25 02:17:07','2017-03-25 02:17:07','12ff7d06-9910-41cd-9eee-bdc21476d119','426624f6-84a9-4ec4-84f3-7655dc70e86e','Very cute place! Small, but equip with everything someone will need and great decor. Within walking distance of beach and many great restaurants. Well worth the price, I highly reccomend!'),('13b8e228-d167-4dcd-b32f-28158b6187af','2017-03-25 02:17:07','2017-03-25 02:17:07','610ef600-53da-4e05-aaaf-b7ae4d14fcfb','df668e22-e344-4c89-a050-e5ad211cbaa6','Worked out perfectly for my visit to MN. Simple, clean, quiet accommodations that were cheaper than a hotel and right in the part of town where I needed to be. Great communication for checkin/out.'),('13dab7f9-766d-4acc-ae4f-b885e44bf57b','2017-03-25 02:17:07','2017-03-25 02:17:07','b6692019-ac4a-47aa-a671-89cd79c9e11f','d622edfa-fc35-4732-b5ec-a15d794267ec','Had a great stay! The apartment was clean, easy to use and had everything I needed for a one. Ugh stay. '),('14d2cf2b-e854-4e3b-a05a-6f02a2e4a339','2017-03-25 02:17:07','2017-03-25 02:17:07','7a958fb6-a203-441c-9f8f-3440523fed14','30a890e4-a62c-44f9-abc0-07e2c74021da','I truly enjoyed the stay, it was definitely as stated. Spacious room that was stayed in. The living place does look like it is within the picture. Fabian was a great host, very warming and friendly which was a great feeling. You might slightly get confused in going to the back to check in, but otherwise fine. The only concern that I had while my stay would be if you plan on going out or working late driving a car is not recommended, drove for an hour in attempt to find parking was quite irritating . Otherwise I loved the stay and would gladly comeback again.<BR />I would give my entire day stay a good 4.5-4.8 minus the parking issue coming back late. <BR /><BR />Muchas Gracias Fabian! '),('14fb5f8d-9363-4912-affc-68bcd2a4746e','2017-03-25 02:17:07','2017-03-25 02:17:07','6ebec357-8589-435b-a5cb-fcd99b638fae','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','Elisa\'s place was incredible. The bedroom was very clean and the bed really comfortable. Great communication too. Elisa was a great host. She is very friendly and helpful. She even left coffee and some snaks in the morning. Great experience, I totally recommend the place! '),('16000e94-6a7c-4383-ab18-150463674b44','2017-03-25 02:17:07','2017-03-25 02:17:07','47b9ca37-915d-405d-861d-7dbf74559441','cf1780e6-d294-4113-8749-1c728b9e3f81','Carmenita is the best host one could ask for and the downstairs apartment is always clean and cozy.'),('16084c13-e28c-47a6-9020-ff06a2b84c6d','2017-03-25 02:17:07','2017-03-25 02:17:07','453b0b1c-6bf3-4e94-8265-082ef06ab85f','91e27a07-1f47-43c9-b851-60c6882abcd3','My daughter an I had a very nice stay in Bruce\'s lovely cottage. Bruce was great about getting us settled in and was very accommodating. I would definitely stay here again. Highly recommended!'),('16124acc-9a83-4308-9fac-9ae15ce41f1a','2017-03-25 02:17:07','2017-03-25 02:17:07','7eceb696-213d-42cf-a58d-fa2e47cfdada','b6160096-c503-4909-a674-7bfbddc8cc45','Very comfortable, quiet home, in great location that is convenient to major transportation routes, shopping, dining and entertainmen