l during my stay.  '),('1dcf4818-a951-4b65-a5b8-84e0efe45bea','2017-03-25 02:17:07','2017-03-25 02:17:07','0d10682b-5bd4-4fde-9427-0067fe6ff63c','85651506-c13c-4c2f-9c79-8fbebc048e39','Great place in a big, beautiful house. Great value for the space!!'),('1e70ca42-864a-4612-b62c-07de7546d56f','2017-03-25 02:17:07','2017-03-25 02:17:07','bcda6018-7286-4d8c-abfa-dda1026adf88','f9b11370-f316-492c-92da-014d7bce7213','Winnie\'s place was cozy and comfortable! Great location and we had a relaxing trip. Winnie sent us spot on suggestions on where to eat and drink! All of her recommendations were amazing, especially the donut place. It was an easy and beautiful drive to the wineries. '),('1f0d7dac-3302-4627-b76a-bc337bbdd90b','2017-03-25 02:17:07','2017-03-25 02:17:07','52cc10db-af9b-499c-aa8e-670056611a7c','30a890e4-a62c-44f9-abc0-07e2c74021da','Place was awesome! Very good place to bring the dog. Neighborhood seems a little spotty but there were no problems! Very good value '),('1f1601e3-e038-4139-9b44-d7416a5e431f','2017-03-25 02:17:07','2017-03-25 02:17:07','eb3c3877-39bc-4de3-8fc3-4f3895c5b2ba','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Emily was a great host. Very kind and with good ideas for local restaurants and attractions. The home is just a short walk to downtown Lafayette with all it\'s considerable charm. I would definitely stay here again.'),('1f200415-785e-42dd-be9d-13f5cc702066','2017-03-25 02:17:07','2017-03-25 02:17:07','5463e312-5bf4-4764-8c06-e97c5548f712','b6160096-c503-4909-a674-7bfbddc8cc45','Megan\'s space and hospitality is perfect for a business traveler or couple traveling to Jackson. Everything has been thought of and taken care of from comfy robes to light snacks to a personal welcome note with a bottle of wine. Megan\'s house will always be our first choice in Jackson!'),('1f78f5e5-f98e-4774-b8f6-5ff3bce9408d','2017-03-25 02:17:07','2017-03-25 02:17:07','695c0586-3345-4b15-bcf7-f5ecbae258e1','00a11245-12fa-436e-9ccc-967417f8c30a','The house in general was very clean and well maintained. The room was very clean, looked like a hotel room and I was very pleased with the presentation. I was pleasantly surprised by the host providing cables for charging which was very helpful.  If you don\'t drive, there are a couple of bus stops near the apartment which makes things more convenient. Communication with the host was clear which helped with finding the place, just use the picture and map that they provide and not the one on airbnb '),('20250979-6295-4ceb-88fa-0216d1857e00','2017-03-25 02:17:07','2017-03-25 02:17:07','af92250e-2f85-4fca-8c04-03029a1b1fad','cf1780e6-d294-4113-8749-1c728b9e3f81','Nice place and Vincent is a good host.'),('20691f95-dcdd-4b8f-8007-4e653bb12907','2017-03-25 02:17:07','2017-03-25 02:17:07','bb86e624-9ecb-4aca-a713-8cd6984f25a0','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','This place was a great stay. Would definitely book here again for the next wine valley trip. A great value for the area!'),('216a35c0-3239-4072-886a-dc4f0c62d7a9','2017-03-25 02:17:07','2017-03-25 02:17:07','14e9cb05-e188-4e02-ab2c-8ef425e5ea64','30a890e4-a62c-44f9-abc0-07e2c74021da','Donna was super friendly, and she made sure we had everything we needed for our stay.'),('2171a4ed-e38b-40a5-a0c6-aa282b111233','2017-03-25 02:17:07','2017-03-25 02:17:07','cb681375-76ad-41d4-ac03-7fe74df9aed3','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','We had the most wonderful stay at the Beachwalk Bungalow.  We arrived very late at night (much later than we\'d said we be there thanks to a travel mishap).  Despite this, the owner, Michelle, waited up for us so that she could welcome us as we arrived and insisted that we text her if we needed anything. Throughout the week, she asked about our trip and told us about great places to see and things to do in the area (including the best local farmers\' market EVER).  One night, when we were laughing like hyenas, Michelle thought we\'d seen a roach and came running out to SAVE US!  We never did figure out who \"Barbara\" is, but we really hope Michelle isn\'t paying her to find guests for her place.  Barbara comes across as very curt (we never met her, though, so we can\'t say for sure if this is truly her personality; we all know it\'s tough to gauge a person\'s tone online).  So, if you\'re considering staying here but are put off a bit by Barbara'),('219e6562-27e5-438d-9a07-48de868d9167','2017-03-25 02:17:07','2017-03-25 02:17:07','ef3f56b8-c024-471e-b7ba-be1a72c6cbec','9eec6c06-5918-4867-833a-face490d4715','This is a great place for the money<BR />Very clean and quiet.  <BR />And Jake is great.<BR />Quick responses '),('224b0828-17d0-4b84-9226-9eba6a6daa96','2017-03-25 02:17:07','2017-03-25 02:17:07','9247dcc1-711a-4ab2-b99a-f2808627d2f2','3ea61b06-e22a-459b-bb96-d900fb8f843a','We loved our stay at the plantation. The host John gave us great recommendations and we breakfast was superb! Loved every hour!'),('22d6aba1-1dad-4d54-ad74-13675f94b586','2017-03-25 02:17:07','2017-03-25 02:17:07','cb681375-76ad-41d4-ac03-7fe74df9aed3','00e93fc3-53ff-4da4-8e72-faa5216f81bb','The bungalow was great. It\'s a cute, well equipped, very comfortable place in an excellent location, close to the beach and shops (including Whole Foods and weekly markets).  It was perfect for our week long stay. Michelle, our onsite host was lovely and very helpful.  I would highly recommend it and would return again without hesitation.  '),('231f2d41-72ac-44ca-833b-386c50bb8af7','2017-03-25 02:17:07','2017-03-25 02:17:07','38e38612-a626-47a9-a699-05efa178e155','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Stay here'),('2332eed3-1a2c-41d8-975f-026e44ae936a','2017-03-25 02:17:07','2017-03-25 02:17:07','1014dfdf-fa7a-487c-bba8-2d3076d570dc','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Randall\'s place is amazing! I would absolutely stay here again, and hope to next time I\'m in Denver. Plenty of delicious snacks provided, and Randall was easily reachable for questions we had during our stay, and even came by