','This place is great! I got a little turned around when initially finding it, not realizing I kept passing it up. I gad to call to get directions and my host, Jason, was so nice and guided me there in a snap!  Once I got there though I realized how great the location is. Its very close to all the fun of downtown Lafayette but far enough to not have to deal with the noise of everything once you want to settle down for the night.  The airstream itself was very nice and clean with amenities such as tea, Luna bars, and beer provided (in my case, strawberry beer ) as well as shampoo and conditioner and nice towels.  I am 5\'6 on a good day and this place was the perfect ceiling height for me (about 1ft- 1 1/2 ft above my head. It seemed spacious and bright in the morning too. I had an excellent time in Lafayette but my time here was definitely the best part.'),('282ce32b-5be3-4a7f-b669-f6c28c216310','2017-03-25 02:17:07','2017-03-25 02:17:07','02d9a2b5-7dca-423f-8406-707bc76abf7e','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Delightful stay.  Irene and Don are very personable and committed to the comfort of your visit.'),('29cb94cb-de21-40b1-9cc9-2f2249402930','2017-03-25 02:17:07','2017-03-25 02:17:07','bcda6018-7286-4d8c-abfa-dda1026adf88','70b18dcc-08ef-4040-91cf-4075973d320a','Amazing communication, Winnie gave us lots of suggestions of things to do, check in was smooth and the place was perfect for a few nights stay. '),('29da8e26-0eb5-4e3c-bb48-fa60c76e4d10','2017-03-25 02:17:07','2017-03-25 02:17:07','645127dd-38b4-4fad-9950-57b3ce0a5301','cf1780e6-d294-4113-8749-1c728b9e3f81','Lovely historic house, sweet host and an adorable cat!! '),('2a4824db-3916-4ac7-9702-559495f034cb','2017-03-25 02:17:07','2017-03-25 02:17:07','207f5bf6-d1de-4cca-a60d-c2c48e93debc','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Jim was a gracious host! He was waiting for us when arrived and gave us a tour of his historic family home. The space was even better than we had hoped - very comfortable and