reat and we didn´t have any problems. WiFi works great, so as air condition. Close are great restaurants and bars with live music. I can definetly recommend this apartment.'),('38e332c7-6221-4074-94b4-de69723cddc7','2017-03-25 02:17:07','2017-03-25 02:17:07','836bea96-c22d-46d2-9335-b97cec4cc30a','426624f6-84a9-4ec4-84f3-7655dc70e86e','We absolutely loved our stay at Ellen\'s! The room is cheery and comfortable, as is the rest of her beautiful home (and the shared bathroom wasn\'t a problem at all!). Ellen was a wonderful host - we appreciated her flexibility with check-in time and her great conversation. Just wish we could have stayed longer :)'),('392e4b15-e1d8-4cd2-9f16-b5cffe64d1b0','2017-03-25 02:17:07','2017-03-25 02:17:07','b4a927e4-9715-4cd2-9918-47491f97df3e','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Doug & Deb are friendly host and what was said in the site is accurate and enjoy !'),('3a3988df-d572-4668-a20e-15073a94d078','2017-03-25 02:17:07','2017-03-25 02:17:07','7b8ecd06-c520-4adc-b2e4-bfaa7f8bab2e','426624f6-84a9-4ec4-84f3-7655dc70e86e','Very clean and everything was available at the place. '),('3a9a15c2-7020-4bbb-9d10-4ba31fa11a81','2017-03-25 02:17:07','2017-03-25 02:17:07','31568a3f-d5b1-47d1-b2ee-74339059e3a0','887dcd8d-d5ee-48de-9626-73ff4ea732fa','Best landlady ever!  Very special place...'),('3accdedc-54fa-4d3d-8967-3134a4265bf6','2017-03-25 02:17:07','2017-03-25 02:17:07','314b188e-990b-423e-ae63-f0199b8c2b17','7771bbe9-92ab-46d1-a636-864526361d7d','Great experience. Booked at the last minute and that was an easy process. Everything was thought out in this small space. It was extremely clean and comfortable. '),('3b2a5795-310e-4b2e-b1d1-45767ebd0210','2017-03-25 02:17:07','2017-03-25 02:17:07','478d6061-fc78-40c3-a1b2-0e906fb86da8','f33e2624-520b-4bc2-b6a0-190ee1d41855','I had a nightmare flying experience and spent over 16 hours in airports thanks to delays. I flew into SJC a day later than expected and in the middle of the night. So I contacte