e1a72c6cbec','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Location is really close to downtown Tempe.  The apartment was cozy and clean.'),('4866d45d-9c21-4d13-bb39-f62bc2bf233a','2017-03-25 02:17:07','2017-03-25 02:17:07','478d6061-fc78-40c3-a1b2-0e906fb86da8','00a11245-12fa-436e-9ccc-967417f8c30a','Quiet, clean, comfortable, great location - just what I needed!'),('48771e28-30db-40ba-8001-d5f58d9c48d7','2017-03-25 02:17:07','2017-03-25 02:17:07','ff46f903-411b-4a16-8e16-1aab7f00686c','887dcd8d-d5ee-48de-9626-73ff4ea732fa','The Boarding House is exactly as advertised. I met four very nice people, including Tiffany and Ryan. The space is relaxed, clean, and eclectic. T & R have extra nice touches to make guest comfortable and welcome. I was there two nights and would come back to stay here on another visit to Bisbee. <BR /><BR />The location is just super. About five minutes or less from all of the city fun when you walk downhill. Five minutes to great visuals, birds, and flowers when you walk up OK Street. '),('488e5739-759e-4c33-b7f9-aff5ba897419','2017-03-25 02:17:07','2017-03-25 02:17:07','dbdc349b-a195-474f-9856-dbe01d08c331','b6160096-c503-4909-a674-7bfbddc8cc45','Welcoming. Small, comfortable room and a nice bathroom at the end of the hall. Very quiet. Thank you for letting me stay!'),('4989a032-71f1-4abc-ab0d-486702c9c915','2017-03-25 02:17:07','2017-03-25 02:17:07','dbdc349b-a195-474f-9856-dbe01d08c331','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','Inexpensive place to stay with just the basics. Clean. Nothing fancy. Perfect if you just need a quiet place to sleep.'),('4994bf49-62e2-4cfe-b2f5-f64bd93a2a11','2017-03-25 02:17:07','2017-03-25 02:17:07','e2d4feeb-4cb0-4df4-a10e-5a54748621b3','cf1780e6-d294-4113-8749-1c728b9e3f81','I was arriving around 9:30 on Easter night. I was met and warmly greeted. After a quick tour, I had the entire house to myself!  Everything is very clean and very charming. I met Pat, Randy and Jane. All were delightful. The breakfast is a super fantastic surprise. If you are in the area, book a room!  You will not be disappointed '),('49a0f733-d01f-4cbb-8b40-2a758e317c8d','2017-03-25 02:17:07','2017-03-25 02:17:07','48bf9579-0f57-426e-9051-a4d3507ad7cd','9eec6c06-5918-4867-833a-face490d4715','We enjoyed our stay at Stacie\' s home. For the price we paid we had a comfortable, happy experience.'),('4a641ad6-cd31-4df0-820f-546118bea5cb','2017-03-25 02:17:07','2017-03-25 02:17:07','f19fa153-154e-440b-9f4b-debee403b0d2','f33e2624-520b-4bc2-b6a0-190ee1d41855','I stayed for 9 weeks as a clinical student at Edward Hospital, and I thoroughly enjoyed my stay. Great drive to work, home was lovely, and Kathi is an amazing host. She welcomed me like family (even took care of me when I got the flu), which made the academic stresses far more manageable since I wasn\'t worried about my living situation on top of it. Also her home is really close to downtown Naperville (5 minute lyft/uber) but in a quiet community, which is like the best of both worlds. I can\'t give her enough stars! '),('4a91fc4a-6e0e-43e1-9454-d404847d7de5','2017-03-25 02:17:07','2017-03-25 02:17:07','e6c33577-5de3-4481-9147-47ef4710b986','7771bbe9-92ab-46d1-a636-864526361d7d','Lani\'s house was central and not far from the airport. About a half hour away from most places and attractions. Lani was benevolent and hospitable. She didn\'t hesitate to help us with anything we asked for or needed. We also met her family and they were nice too! We were out most of the time and she understood and respected that. She even washed our clothes while we were out! This place is PERFECT for people who visit Oahu to go out and explore the island but don\'t want to sit by a pool all day. Thanks, Lani!!'),('4ab0b168-fc47-47cb-8643-97f4ab3b18ea','2017-03-25 02:17:07','2017-03-25 02:17:07','d991f849-0f2f-41cb-b6d7-41feee6bc943','00a11245-12fa-436e-9ccc-967417f8c30a','Really nice room with balcony, attached bathroom, and walk in closet. I was very comfortable. '),('4b2d0c