check in was very easy. Just a quick bus ride to Waikiki Beach and great access to Walmart, Pharmacy and other restaurants. Definitely great for professionals and tourists.  '),('4bd3764f-9525-4341-9e7f-c8293f71da7e','2017-03-25 02:17:07','2017-03-25 02:17:07','b7a46879-c82a-46d9-9ea9-43cbefca2f81','b6160096-c503-4909-a674-7bfbddc8cc45','Barbara\'s place is clean and wonderful! They are super nice and willing to share all they know about this town! You will not regret choose this place! '),('4c4bc8c9-6fd3-497e-9b19-e018d8a9d78a','2017-03-25 02:17:07','2017-03-25 02:17:07','62e75faa-d265-4ca1-a009-1e06f1d6ab14','70b18dcc-08ef-4040-91cf-4075973d320a','Ellie is an excellent hostess and was very helpful in answering my questions about Chicago. It was a very clean apartment with an amazing view. The location was close to great restaurants and attractions. '),('4d0ec895-5e31-48df-b326-bcbc03498cd1','2017-03-25 02:17:07','2017-03-25 02:17:07','9c7d3ecd-9592-4910-bd04-91c59e8350f1','8394fd35-8a8a-479f-a398-48f53b4a6554','Chris\' pool house was exactly what I needed after a long day on the road. Very quiet and unique. Sat by the fire pit, listened to my tunes on the rock box, and sipped bourbon. Chris communicated timely, described everything accurately, and had everything ready when I arrived. Looking forward to the next visit!'),('4d325840-91c9-4725-ab72-7968d57fcb06','2017-03-25 02:17:07','2017-03-25 02:17:07','0a454f9a-eaac-488b-8443-23cf58f7ae37','df668e22-e344-4c89-a050-e5ad211cbaa6','Great location!  Busy all day exploring the island.  Best location,  walking to beach for sunrise was such a wonderful and peaceful experience'),('4d35bb60-a8b7-453e-aff7-0db17fc372be','2017-03-25 02:17:07','2017-03-25 02:17:07','cb681375-76ad-41d4-ac03-7fe74df9aed3','d622edfa-fc35-4732-b5ec-a15d794267ec','We loved staying in this cozy place! Perfect walk to Kailua beach. My favorite part was how QUIET AND PEACEFUL it was! My husband and I were visiting from a city life and we both felt like we slept like babies! Perfect breezes, crickets and birds- but quiet residential neighborhood. Michele was super accommodating! Thank you for a great week!! Mahalo!'),('4d4aadba-246c-41e2-9acd-d2c48ad59f08','2017-03-25 02:17:07','2017-03-25 02:17:07','38e38612-a626-47a9-a699-05efa178e155','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','If you like the family feeling or you are a group of travellers, this could be your place. The apartment is wide with 6 rooms, mine had 2 bunks but I don\'t know about the other rooms. Also you will find a nice swimming pool.<BR />Mario is a nice host, and the communication with him was easy.'),('4d7a1d3f-f209-42df-80e1-21cf871009c1','2017-03-25 02:17:07','2017-03-25 02:17:07','c29b5191-ac68-4e9b-a68f-aa42ea1dcb01','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','Cayla was great. Her home is beautiful and she was a great communicator!'),('4dcfbc6b-a065-4467-b8af-eb8df2ea2885','2017-03-25 02:17:07','2017-03-25 02:17:07','7eceb696-213d-42cf-a58d-fa2e47cfdada','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Great place. Beautiful home in a nice quiet neighborhood'),('4dec3a16-d121-4b1b-9bce-3b046ead7388','2017-03-25 02:17:07','2017-03-25 02:17:07','0d10682b-5bd4-4fde-9427-0067fe6ff63c','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Robin and Haynes are incredibly sweet, approachable and helpful. They offer a lot of great recommendations about things to do, and Robin is very prompt with her responses about check-in and information about her place. An added plus is that her dogs are very adorable and friendly. And as someone with a mild allergy to dog dandur, I had no trouble and didn\'t sneeze once. The place is very clean and cozy. The house is very close to the Vulcan Trail, so if you are someone who enjoys a good view and nice walk, I\'d highly recommend staying in the area. '),('4e1c7270-2302-4c39-9d4e-dd5d393a8d2e','2017-03-25 02:17:07','2017-03-25 02:17:07','b33cae89-fe4f-4c6e-a1c5-0022450f2bf2','61302be9-4b31-4be0-92fc-d0dda253e167','I stayed at Michele\'s place for 2 nights. The place is exactly like the pictures in the listing. Being a 1-minute walk to the beach was the best. Michele provides extra towels and beach towels; it came in handy for our beach trips every day. Michele is a great host and very responsive. We didn\'t encounter any problems while staying at her place. Thanks Michele!'),('4e456426-ed11-45c8-b9fb-c9dad66d1db5','2017-03-25 02:17:07','2017-03-25 02:17:07','09b4888f-0e06-4ab1-abbc-05e9865634d0','d622edfa-fc35-4732-b5ec-a15d794267ec','Beautiful room in a perfect location to downtown Baton Rouge. Quiet neighborhood and nice and friendly owners. They have good timely communication when trying to book something. Room very nice and clean with separate entrance and bath from rest of the house. '),('4e745a31-8d5c-496a-8d2c-71891b702faf','2017-03-25 02:17:07','2017-03-25 02:17:07','dce54621-9083-4cd9-9335-a9e8861289d8','85651506-c13c-4c2f-9c79-8fbebc048e39','Fantastic place, great staff, close to great places for entertainment..... '),('4f062ce4-6234-4977-9b62-55d968b9d39f','2017-03-25 02:17:07','2017-03-25 02:17:07','d991f849-0f2f-41cb-b6d7-41feee6bc943','91e27a07-1f47-43c9-b851-60c6882abcd3','Had a comfortable stay here. First Airbnb so I wasn\'t sure what to expect and have nothing to compare this experience to. The price was good for the stay -- some things were lacking IN ROOM like cups/water... and communication, but overall it wasn\'t a deal breaker and I would stay again. '),('4f43e15c-9a3b-4808-8645-62b2501c2023','2017-03-25 02:17:07','2017-03-25 02:17:07','e979e012-bcb1-47ea-bb39-140cdfe0f917','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Clean, comfortable, quiet, basically perfect for two or one person. It has its own bathroom which was really nice. Clayton gave us some suggestions of hikes around the area that were really cool! It was also nice to use the kitchen if we needed it. Overall a great place!'),('4f501f92-3a0f-4ec2-b0af-5cb3b2253008','2017-03-25 02:17:07','2017-03-25 02:17:07','9c5a1e44-009