 way to kitchen, bathroom and other rooms, so very noisy avec people passing by our room... <BR /><BR />The number of people could be a good thing to meet new people and make friends... but be aware of the cons if you are fine with that the location is convenient, I didn\'t have good nights of sleep there but you cannot beat the price '),('5177c5e6-d7f7-4133-b05c-40ee4f46ef13','2017-03-25 02:17:07','2017-03-25 02:17:07','d72f839c-9390-4085-9d39-b45144c9c3c8','f33e2624-520b-4bc2-b6a0-190ee1d41855','Worth the stay - very relaxing. Very rustic and peaceful especially at night. '),('518ae513-811d-4a28-9c10-6f9a28944bb7','2017-03-25 02:17:07','2017-03-25 02:17:07','478d6061-fc78-40c3-a1b2-0e906fb86da8','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Great place, really nice guy! Very helpful!'),('51c82d5e-5193-4488-b471-551f19d6c36c','2017-03-25 02:17:07','2017-03-25 02:17:07','be13aa0e-8da7-4943-be05-5fd89f4d18e6','00a11245-12fa-436e-9ccc-967417f8c30a','Reeva was cool and chill just like her place.    Very hospitable! I think the bed was made out of clouds.  I slept so good! She had water and little snacks for me in the room.  Great place to stay if and when you are in Tupelo, MS!'),('528d30c2-f969-4ec9-aeee-5028673a60f3','2017-03-25 02:17:07','2017-03-25 02:17:07','eb3c3877-39bc-4de3-8fc3-4f3895c5b2ba','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Staying at Emily\'s place was great. Especially since we brought our dog on our trip. Thank you Emily for your hospitality.'),('52d32d59-3174-4b39-8e23-fe8a1f3863be','2017-03-25 02:17:07','2017-03-25 02:17:07','0675a2d6-f64c-4be7-9a8a-f55341f09d4b','85651506-c13c-4c2f-9c79-8fbebc048e39','this was fine for what i needed. it\'s not a space to spend time in, but the futon bed was comfortable, and the place was heated well.'),('53224507-ecb9-40c8-a3e5-33ad5686eb73','2017-03-25 02:17:07','2017-03-25 02:17:07','6d24beec-f296-473c-a34a-4dd9aab8a780','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Stellar spot'),('53e42a62-bd5c-495e-aa23-390567c38ba2','20