62c-44f9-abc0-07e2c74021da','It was definitely worth the price and had a great view. And by great I mean GREAT. '),('577a2d13-dc64-4ee2-ada8-a7416cc7f051','2017-03-25 02:17:07','2017-03-25 02:17:07','cb681375-76ad-41d4-ac03-7fe74df9aed3','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','This was our second time to Kailua and we were definitely happy with the location of Beachwalk Bungalow. Everything was as we were expecting. Lovely hosts who don\'t bother you but are available when you need anything and they have some of the friendliest 2 dogs we\'ve ever met.'),('579f645d-240f-4613-b832-893021d03574','2017-03-25 02:17:07','2017-03-25 02:17:07','0b96262f-2c72-464c-a182-8f58afde4288','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','We loved the convenience, character and personality of this place. We were very comfortable and would return.'),('57af0e18-49e6-4bae-987a-b634df5b6510','2017-03-25 02:17:07','2017-03-25 02:17:07','836bea96-c22d-46d2-9335-b97cec4cc30a','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Ellen is personable and her home is charming and comfortable.  We enjoyed our stay.'),('57b8e5b5-8c4f-47c3-8129-6d74d57e382d','2017-03-25 02:17:07','2017-03-25 02:17:07','0a454f9a-eaac-488b-8443-23cf58f7ae37','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Exceeded expectations <BR />Pam and her place are awesome and great location '),('581e190a-ec94-4390-8e9d-a5cc2ccec537','2017-03-25 02:17:07','2017-03-25 02:17:07','ae787938-171f-4563-8c75-92a037fed415','f9b11370-f316-492c-92da-014d7bce7213','My mother and I stayed here, using both of the rooms available. I slept on the pull-out couch (which was extremely comfortable). Hannah and Richard were great hosts and I recommend staying with them wholeheartedly. '),('592c1b53-0099-4033-b7e5-9fcd66608faf','2017-03-25 02:17:07','2017-03-25 02:17:07','b13b1a74-3a12-4f00-8c19-273cbedc0eaa','3ea61b06-e22a-459b-bb96-d900fb8f843a','Great view, colorful and comfortable house. Those 90 stairs keep you honest.  :)'),('59318363-98d0-4135-a451-1fdf77d00b3c','2017-