2017-03-25 02:17:07','0b96262f-2c72-464c-a182-8f58afde4288','887dcd8d-d5ee-48de-9626-73ff4ea732fa','Great place for our family. Kids loved the pond in the backyard. Good location. Francis is very easy to communicate with.'),('5b123026-e90e-4973-9218-5f16ad1a2130','2017-03-25 02:17:07','2017-03-25 02:17:07','a16c7358-bf66-4802-8933-1616b5a322db','df668e22-e344-4c89-a050-e5ad211cbaa6','Perfect location and beautiful studio!!'),('5b3abb93-48de-4927-9ef2-5a60398d59ae','2017-03-25 02:17:07','2017-03-25 02:17:07','6ebec357-8589-435b-a5cb-fcd99b638fae','91e27a07-1f47-43c9-b851-60c6882abcd3','Elisa\'s place is so welcoming and immaculate.  I talked to her once or twice when I was there and she was super sweet and accommodating, and even had breakfast treats out each morning!  I had some issues getting in due to inclement weather, and she was quick to communicate, and even refunded me a night because I literally could not get there from the airport. She could not have been nicer about the whole situation! <BR /><BR />My bedroom was super clean and private and smelled amazing.  I think that bed is literally the most comfortable bed I\'ve ever slept in.  Seriously, haha.  <BR />She has a key-code security system that makes it super easy to come and go, which I loved. <BR /><BR />The surrounding area is very nice and beautiful just like her home!  Pretty secluded, but I loved the nature and surroundings on my drive to and from the house.<BR /><BR />I highly recommend Elissa\'s place!  I will definitely be staying with her again when I go out to visit my family again! :) '),('5b79a25e-c857-4708-874f-c26610661ca9','2017-03-25 02:17:07','2017-03-25 02:17:07','52d726db-2427-40ca-a5f0-d5c117625d1c','fa44780d-ac48-41ab-9dd0-ac54a15755cf','This was such a phenomenal experience. Jay and Jessica were such wonderful hosts- responsive, welcoming, friendly- and the place is just amazing. Beautiful neighborhood, the cottage is awesome-  can\'t say enough good things. We will definitely be back!'),('5be9ecc8-1655-4ba9-9147-5ec5fde307b4','2017-03-25 02:17:07','2017-03-25 02:17:07','0675a2d6-f64c-4be7-9a8a-f55341f09d4b','32c11d3d-99a1-4406-ab41-7b6ccb7dd760','If you\'re looking for a cozy and lived-in space, this is the room for you!  The room is very clean and well decorated.  Our hosts traveled a lot too so you\'ll get to see all the cool travel memorabilia. It was awesome to see some stuffs from when they traveled to my hometown! Hosts are quick to respond to questions, very friendly and welcoming.  They even gave me a tour of the space and the rooftop with a phenomenal view.  Parking can be an issue but there are some tips in their notes. We took Lyft everywhere which is quick and cheap because we\'re in the center of everything. There are tons of stores right around the corner of this building and a 7-Eleven a couple steps away for anything you might need. I would highly recommend this place!'),('5c109cf5-fb36-40cf-b572-8620b536fcac','2017-03-25 02:17:07','2017-03-25 02:17:07','9c5a1e44-0090-464b-ac3b-89e0f65cc6e1','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Place is very affordable which is great for travelers. Communal kitchen was also handy, but kind of cramped. <BR />Overall super friendly vibe and though it\'s located up a steep hill that\'s further than is worth it to walk, the bus stops only a couple blocks away. '),('5c21cdff-2110-416b-a30f-6afa70e22b0f','2017-03-25 02:17:07','2017-03-25 02:17:07','e74201c2-6057-419d-be22-d0087eeb4179','426624f6-84a9-4ec4-84f3-7655dc70e86e','I stayed upstairs which was basically a combined open living area and sleeping area that led out to the balcony. While there was no closed off private space, I was the only one in this area so to me it felt pretty private and I enjoyed the space. As for the rest of the house, there were many other people staying, but most of the time no one was ever in the common areas so it felt like no one was around. I think this is a good affordable place to stay for solo travelers. Sherry has a good heart and took care to ensure a comfortable stay throughout!'),('5c5167cb-b82d-4079-b205-8bceb68c412b','2017-03-25 02:17:07','2017-03-25 02:17:07','0d10682b-5bd4-4fde-9427-0067fe6ff63c','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','Robin\'s place was nice for our quick stay in Birmingham. It was a good location, a nice room, and was just what we needed. I\'d gladly stay again.'),('5c735cce-9731-48f7-aaae-db369e9f3698','2017-03-25 02:17:07','2017-03-25 02:17:07','b6ea25aa-f298-4f24-bc8c-526439f254d5','00e93fc3-53ff-4da4-8e72-faa5216f81bb','It\'s an awesome place! Safe and quiet neighborhood, beautiful house. Recommended! '),('5ccfa509-d904-40b8-bb0f-c64b24c7a5d3','2017-03-25 02:17:07','2017-03-25 02:17:07','8835ba11-7757-45c6-9138-f7e2e4b5f80f','00a11245-12fa-436e-9ccc-967417f8c30a','It\'s on a small cul-de-sac off a small street in a quiet neighborhood. There\'s lots of airflow, but still manages to be very cozy. Listening to the rain at night was lovely. <BR />Medium walk to the beach, maybe 25 minutes walk to downtown Kailua. '),('5cf12ed5-6ae2-4e80-b8c7-d2ce95c38448','2017-03-25 02:17:07','2017-03-25 02:17:07','19ae5055-f503-499d-a64f-2bf7d92eff5b','7771bbe9-92ab-46d1-a636-864526361d7d','I was able to book a very last minute stay for the weekend at Joes place. He is quick to respond and provided very clear, detailed instructions right away. <BR /><BR />Dedicated parking space is a massive convenience. Easy lockbox entry. Quiet building. Host is friendly & easy going. Very central location. '),('5e153086-f746-43d7-ab39-7bf95a1f9705','2017-03-25 02:17:07','2017-03-25 02:17:07','9a4d1511-f149-485c-a66b-0ca3fa105ad7','85651506-c13c-4c2f-9c79-8fbebc048e39','Super clean and cute. Rachel was very responsive. Would definitely stay there again!'),('5e477470-91e8-4e3d-b100-7e8adcdc5187','2017-03-25 02:17:07','2017-03-25 02:17:07','1014dfdf-fa7a-487c-bba8-2d3076d570dc','3ea61b06-e22a-459b-bb96-d900fb8f843a','Although just starting on his Airbnb host journey, Randall has it all worked out. His private suite is perfect in every way. As a veteran airbnb guest and host, I am happy to give Randall my highest praise and report that he provided a great and memorable experience. 10 stars!'),('5e59b478-deff-48cb-a7a1-0623c7550704','2017-03-25 02:17:07','2017-03-25 02:17:07','b5880e7d-c4b7-497e-ac1a-12826327132f','3ea61b06-e22a-459b-bb96-d900fb8f843a','The perfect spot! Great location, beautiful, clean, minimalistic interior with crystals & organic products. Jasmine is an awesome host & will make you feel welcome straight away! '),('5eef6067-f071-4cb9-85c9-a6c409f9f7a3','2017-03-25 02:17:07','2017-03-25 02:17:07','2b6e6650-5f69-426d-a084-71f7ad30d1f1','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Nathalie\'s place in Kailua was perfect for a quiet weekend with my wife. We spent our time walking the long white beach (only 1 block from the house) and dining at all the fun places in town (also within walking distance). The place was clean, quiet, and communication with Nathalie was easy peasy. I would wholeheartedly recommend a stay for peace, relaxation, and a taste of the laid back Kailua lifestyle. '),('5f652959-451d-4270-aa32-00a295149672','2017-03-25 02:17:07','2017-03-25 02:17:07','a12e6da9-0797-4445-9626-d5f0fa5ed775','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','We rented this place because we were attending a funeral in Birmingham. It was really the closest to Birmingham we could find in our price range and that wouldn\'t be out of the way for the interment, which was in Montevallo. If we were only going to be in Birmingham, it was a bit far. But if you\'re travelling to Montevallo for any reason, this place is perfect. It\'s tucked away up on a wooded hill and there is a lot of space. It was just the two of us and we could have brought the entire family (not that we wanted to do that). The place is furnished well and there are coffee supplies and bottled water in the kitchen. It was cold the two nights we were there and the furnace seems to heat a bit unevenly but there are a couple of space heaters which made up for that quite nicely and my husband and I were warm. We had a little trouble deciding on our sleeping arrangements - the first night we slept separately in the two ground level bedrooms which have full size beds, and the second night '),('5f972264-a8ee-426a-9d07-7411913e1d4f','2017-03-25 02:17:07','2017-03-25 02:17:07','02d9a2b5-7dca-423f-8406-707bc76abf7e','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','This is a comfortable charming home uniquely decorated-each room i different The facilities were clean, warm and up to date. {effect for a congenial group to relax between exploratory adventures in Bisbee. Our hosts provided a generous breakfast and refrigerator full of drinks and fruit and yogurt, we really did not need to go out for breakfast. the beds  were comfortable and cozy. And we enjoyed meeting our hosts who  greeted us an d provided answers to all our questions and suggestions for dining and sightseeing.'),('5fa2f28a-4e7b-414d-a639-228b8b8063ce','2017-03-25 02:17:07','2017-03-25 02:17:07','ae787938-171f-4563-8c75-92a037fed415','85651506-c13c-4c2f-9c79-8fbebc048e39','Richard and Hannah are delightful hosts. They have created a comfy and welcoming get away. '),('604b8cc7-b53b-4906-919b-1501838b9b5c','2017-03-25 02:17:07','2017-03-25 02:17:07','3827c1d1-14d5-4643-a24b-3dca656192fa','3ea61b06-e22a-459b-bb96-d900fb8f843a','Chantal\'s place was extremely clean and very nicely decorated. The bed was comfortable and the room was quiet. We had everything we needed, and our hosts were sweet and helpful. Would definitely recommend! '),('60bcaff9-d346-4e28-a144-11c8469b9596','2017-03-25 02:17:07','2017-03-25 02:17:07','acd9cdca-855e-484b-baf9-ffda99d945f2','7771bbe9-92ab-46d1-a636-864526361d7d','Cindy\'s place is wonderful! It has an incredibly warm and comfy atmosphere and had everything we needed for a weekend away. I brought a large group of college students for a staff retreat and it was the perfect get-a-way for us to rest and relax, and it is really close to the mountains which allows for some fun adventures too. Cindy was an amazing host (and her homemade cookies are really delicious!). I would highly recommend this home!'),('60d304f1-ca2c-4a20-a1da-5d9b64cdfbf3','2017-03-25 02:17:07','2017-03-25 02:17:07','3ebfaf23-cede-4cf0-964d-8afc17b11d02','3ea61b06-e22a-459b-bb96-d900fb8f843a','I was blown away by Jan and Charlie\'s stellar hosting before I even arrived at their place in Jackson -- they were so communicative and focused on making sure I\'d be comfortable. Once I arrived, the experience somehow got even better: the cottage is wonderful, and every detail seems to have been considered and taken care of. I enjoyed sitting on the porch in one of the rocking chairs and reading, talking to Jan, and just taking in the lovely courtyard. This is Southern hospitality at its absolute finest: if you have the chance to stay here, don\'t pass it up!'),('60ecfaa2-fa86-4ba5-8491-be2a7b4e7dcb','2017-03-25 02:17:07','2017-03-25 02:17:07','a302bce0-cb8e-4e54-ba2b-0822b0565303','d622edfa-fc35-4732-b5ec-a15d794267ec','Loved the hilltop view but wow what a climb to get there! the windows and porch gave such a panoramic view. Liked the comfortable bed, good wifi access, and the opportunity to get laundry done.'),('613edd6c-f7d7-4932-94b9-06ac7cacb93b','2017-03-25 02:17:07','2017-03-25 02:17:07','31568a3f-d5b1-47d1-b2ee-74339059e3a0','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Great property   good location And a great owner...'),('6147263f-4c32-44c0-853d-4ced2f03a31e','2017-03-25 02:17:07','2017-03-25 02:17:07','bb86e624-9ecb-4aca-a713-8cd6984f25a0','d622edfa-fc35-4732-b5ec-a15d794267ec','Great location. Comfortable stay. '),('616acfa4-c712-46fe-b001-9d745d0c992a','2017-03-25 02:17:07','2017-03-25 02:17:07','0d10682b-5bd4-4fde-9427-0067fe6ff63c','32c11d3d-99a1-4406-ab41-7b6ccb7dd760','Awesome place. Awesome people '),('61f5356e-7561-472b-9886-74a5a9549013','2017-03-25 02:17:07','2017-03-25 02:17:07','6d24beec-f296-473c-a34a-4dd9aab8a780','426624f6-84a9-4ec4-84f3-7655dc70e86e','This was a great location and place to stay. My sister and I really felt at home. Jonny was great && took care if our check in and Ginger was a great host with a list of things near by to do and eat. We loved Denver and when we come back we hope to stay with Ginger and Jonny again. Thank you again!!! '),('6261bca6-80ff-421d-8bf2-263ebaf0dc01','2017-03-25 02:17:07','2017-03-25 02:17:07','d27f17eb-3ddd-44c0-9e8a-f3c21d933b3b','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','Clean, located near lots of parks and attractions. There even seems to be a city bus that stops in front of the house. '),('626e7616-2496-45ff-b355-f73d7d225d49','2017-03-25 02:17:07','2017-03-25 02:17:07','6f59f0c7-f3f6-419f-9a8c-9d998a3b681c','00e93fc3-53ff-4da4-8e72-faa5216f81bb','I absolutely loved staying at Daniel’s place! The room is beautiful and cozy, and the bed is very comfortable. Daniel was generous, kind, and willing to go the extra mile to make sure that we had everything we needed for a comfortable stay. I truly recommend this airbnb to anyone!  '),('63512dda-fc85-4d94-97ce-ed9766ff8834','2017-03-25 02:17:07','2017-03-25 02:17:07','7b8ecd06-c520-4adc-b2e4-bfaa7f8bab2e','8394fd35-8a8a-479f-a398-48f53b4a6554','Close to great snorkeling and hiking! Great stay at a cute studio. '),('6368e558-2141-4d46-b2d4-095165bdb892','2017-03-25 02:17:07','2017-03-25 02:17:07','b493f8ca-c5d2-414a-9441-6cd4dcebcd36','887dcd8d-d5ee-48de-9626-73ff4ea732fa','The location was wonderful, lots of space with a great view of old Bisbee.  Very walkable to tons of nearby restaurants and businesses.  Melanie was very responsive and everything was exactly as described.'),('63a6074d-c5ad-4fc8-8469-5759b9f45551','2017-03-25 02:17:07','2017-03-25 02:17:07','96fcc267-3257-4260-a264-b3d80639b7c9','cf1780e6-d294-4113-8749-1c728b9e3f81','The host canceled this reservation the day before arrival. This is an automated posting.'),('63efed12-283c-4af9-9a11-60cd6dfa49c8','2017-03-25 02:17:07','2017-03-25 02:17:07','7b8ecd06-c520-4adc-b2e4-bfaa7f8bab2e','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','Shiori\'s place is great. It is exactly as pictured. Everything was very clean. The bed is comfortable. And the neighborhood is quiet.<BR /><BR />Shiori responded quickly to any question or concern. <BR /><BR />It is close to a lot of things. In 2 days We were able to get to the beach, Hanauma Bay, Diamond Head, Pearl Harbor, Makapu\'u Lookout, and Koko Crater Botanical Gardens. <BR /><BR />There are grocery stores and restaurants nearby. We treated ourselves to a meal at The Original Roy\'s. Delicious!!! Get the butter fish. <BR /><BR />Would definitely stay there again.  <BR /><BR />Thanks Shiori!<BR /><BR />'),('64874a87-61e5-4c2d-9a61-a91de6150662','2017-03-25 02:17:07','2017-03-25 02:17:07','acd9cdca-855e-484b-baf9-ffda99d945f2','fa44780d-ac48-41ab-9dd0-ac54a15755cf','Greg and I, our four children, spouses, five grandchildren, and Callie the dog had our 2nd annual family reunion at the Roost in March 2017.  Our host, Cindy, was there to welcome us when we arrived, brought us freshly baked cookies, and offered many good suggestions for sightseeing, exploring, and eating.  The Roost was the perfect size and setting, in addition to being well-supplied with things we needed.  We all loved being together and checking out the immediate area and beyond.  The younger grandkids especially loved watching the trains go by, and the older ones had a great time at the Renaissance Festival, the old mine site, hiking, and a couple of museums in Phoenix.  We highly recommend the Roost and are now enjoying the memories we made there.'),('6500d73f-13a0-46fa-8a8c-0cbd2ab685d6','2017-03-25 02:17:07','2017-03-25 02:17:07','d72f839c-9390-4085-9d39-b45144c9c3c8','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Easy to get to, peaceful setting, lovely animals!'),('6562086c-0245-4e20-81de-b0ed89e271f6','2017-03-25 02:17:07','2017-03-25 02:17:07','09b4888f-0e06-4ab1-abbc-05e9865634d0','9eec6c06-5918-4867-833a-face490d4715','This space was awesome! My wife and I came up for our anniversary and this space was perfect. It was private, comfortable, VERY clean, and had a lot of surprise amenities. We wish we could have stayed longer. This is definitely a favorite for whenever we return to Baton Rouge.'),('657c4a25-e848-4f67-95f4-fd369099d881','2017-03-25 02:17:07','2017-03-25 02:17:07','e6c33577-5de3-4481-9147-47ef4710b986','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','Joanna and her husband are extremely kind.<BR /><BR />We arrived late and they were waiting for us (they knew we didn\'t have internet connection for communications.)<BR /><BR />Our room was big and we were able to sleep with windows open. There is no external noise whatsoever. <BR /><BR />Their home is about 20-25 min from the airport. I suggest to avoid taking the highway after office hours. You risk to get stuck in traffic for quite a bit.<BR /><BR />Definitely I will return to Joanna\'s place on my next trip to O\'hau.<BR /><BR />Mahalo,<BR />Davide & Ben.'),('65a9ba6f-ec8d-4892-9c43-176afc01615d','2017-03-25 02:17:07','2017-03-25 02:17:07','b4a927e4-9715-4cd2-9918-47491f97df3e','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Deb and Doug\'s place is beautful, clean and well furnished. They are super nice and we enjoyed our stay there, thanks a lot for being such a wonderful host.'),('65b61798-2953-4cca-8a4a-6074912f42c8','2017-03-25 02:17:07','2017-03-25 02:17:07','df2548db-377d-422e-b805-4e8e0c794302','70b18dcc-08ef-4040-91cf-4075973d320a','This was our first Airbnb and it was phenomenal. Our host was very accommodating and inviting. The room was very quiet and calming with a beautiful view over Birmingham. Our host was out of town the weekend we came, but went out of his way to stop by and assure we were well settled. It was overall an amazing experience and we plan to stay here again if we are ever in the area.'),('661fc74e-034b-474b-9ce6-46b0e73e6a38','2017-03-25 02:17:07','2017-03-25 02:17:07','3c702a05-81f1-450e-b07f-386ae8a3b124','f33e2624-520b-4bc2-b6a0-190ee1d41855','Amazing place! Very convenient if you are in Napa for a night out. Host are very nice, polite and approachable. '),('669f4e43-9c7b-4e52-90f6-3c0918685c0c','2017-03-25 02:17:07','2017-03-25 02:17:07','1014dfdf-fa7a-487c-bba8-2d3076d570dc','85651506-c13c-4c2f-9c79-8fbebc048e39','This one, by far, one of the best listings I\'ve had the pleasure of staying in. Randall was an excellent host and communicated often, even asking if I needed any specific groceries. The studio is exquisite: it\'s decorated very well and has far more amenities than some 5-star hotels I\'ve stayed in. The infrared sauna was a treat; nothing like sweating out the toxins after traveling all day! And then there\'s the amazing shower (and yes, there\'s a deep, jetted tub for those of you who prefer long baths). He offered many toiletries for my use, even Origins masks, which I splurged on and used two. The bed was comfortable and the rugs that are on the floor are nice and soft; bring slippers or socks if you get cold feet, though, as most of the floors are not carpeted. The Nespresso machine was a treat (I could even make my own foam for a cappucino!) and Randall left snacks and drinks in the fridge. If you\'re looking for a ..'),('676871ad-0beb-494e-8b6b-d0c6336c7a16','2017-03-25 02:17:07','2017-03-25 02:17:07','b4a927e4-9715-4cd2-9918-47491f97df3e','61302be9-4b31-4be0-92fc-d0dda253e167','We HIGHLY recommend this Airbnb!!!!!! Deb and Doug\'s lovely home was the perfect start to our romantic anniversary getaway.  The room feels very private and cozy with a luxurious bed and sleek bathroom. They thought of absolutely everything and more - from extra toiletries, bottled water, and a wine fridge to 2 for 1 winery coupons. Free coffee and tea. The jacuzzi tub was a perfect way to relax after a day of wine tasting. Downtown is a 5 minute drive away and all the wineries are an easy, beautiful drive. Deb and Doug were available for anything we needed yet respected our privacy. We had a great time getting to know them and their adorable kitties. '),('6792305b-6166-452e-a664-2f893364eb2b','2017-03-25 02:17:07','2017-03-25 02:17:07','3290a4ef-4241-4fa5-843e-87926c74e384','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','Great place, sweet dog, cool dude'),('67f261ff-cc1a-402d-b1a9-d20b41ba5cf7','2017-03-25 02:17:07','2017-03-25 02:17:07','9c5a1e44-0090-464b-ac3b-89e0f65cc6e1','b6160096-c503-4909-a674-7bfbddc8cc45','Unrealistically amazing in every way shape and form. The yin to my yang. Jk. Its legit folks. Peace! '),('685de83b-3859-4b31-9349-ad6d62d8f2df','2017-03-25 02:17:07','2017-03-25 02:17:07','836bea96-c22d-46d2-9335-b97cec4cc30a','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Ellen is an excellent hostess and is very thoughtful in her preparations. She is easily available thru the messaging system on Air BnB. Her home is inviting, beautiful, and comfortable. We  would recommend her home to others. '),('68c8ec29-b15d-401a-88b5-09afe91b34fd','2017-03-25 02:17:07','2017-03-25 02:17:07','7eceb696-213d-42cf-a58d-fa2e47cfdada','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','David was kind and welcoming. His place is very spacious and comforting for a solo traveler or many people. Would definitely recommend!!'),('68f35c4b-05ae-45b8-ac6d-6bd10d7236d6','2017-03-25 02:17:07','2017-03-25 02:17:07','d72f839c-9390-4085-9d39-b45144c9c3c8','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','The cabin is nice enough and the surrounding desert is beautiful, but be sure to pack like you will be camping. We didn\'t have electricity on the second day and couldn\'t use any of the kitchen appliances to prepare food. The road into the ranch crosses a riverbed, and you will want to have a high-clearance vehicle during and after inclement weather (and maybe at other times as well; we were there during a rainy spell). There is plenty of opportunity to spend time outside, but we didn\'t find a terribly conducive spot. It\'s difficult to move through the river bottom near the ranch, so hiking is somewhat limited except along the road. Lots of wildlife though and definitely a quiet place to pause and reflect.  '),('68f6b461-8e34-474f-9359-d1b900fb3423','2017-03-25 02:17:07','2017-03-25 02:17:07','b13b1a74-3a12-4f00-8c19-273cbedc0eaa','3ea61b06-e22a-459b-bb96-d900fb8f843a','Juan\'s place is a great place in the heart of Bisbee. If you want to know what it\'s like to live in Bisbee, this is the place! There are tons of stairs, so be prepared (but that\'s how houses are built there). Parking is very tricky. You have to go up this narrow, steep, cobblestone road. Best to do it with a spotter. But if you can commit to parking and then walking for the rest of your trip, it\'s worth it. The house itself is very nice. It\'s clean and comfortable. The outdoor patio is awesome! We really enjoyed our stay. '),('691f655f-dbd4-4b4a-a593-c8810092bfb5','2017-03-25 02:17:07','2017-03-25 02:17:07','8c2f2c57-a172-4689-a070-cbb4cd456c5c','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Michael was a great host - he extended my last minute request and the place was kept clean. '),('694269a9-d7d4-488f-877f-c8cdc38d6c36','2017-03-25 02:17:07','2017-03-25 02:17:07','62e75faa-d265-4ca1-a009-1e06f1d6ab14','00a11245-12fa-436e-9ccc-967417f8c30a','Great view of Chicago, nice apartment.  Elli was a great host '),('6aa650c7-ee55-445d-ac0f-5e346f23ead5','2017-03-25 02:17:07','2017-03-25 02:17:07','32945f6e-5a96-4233-b8ae-048d51323d7b','b6160096-c503-4909-a674-7bfbddc8cc45','you will be happy to stay with Belle. Lovely premises and very helpful.'),('6ac36161-a9b4-4c9f-9d33-16dabc5ae737','2017-03-25 02:17:07','2017-03-25 02:17:07','b7a46879-c82a-46d9-9ea9-43cbefca2f81','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','I loved Barbara\'s cozy cottage. It was perfect for during my long conference weekend in Eugene. Every time I thought, \"I wish there was…\" I found it! The cottage is just the right size for one person or a couple. The kitchenette was especially handy and well stocked with gear and basic food supplies. Even though the cottage is located in a pretty adjoining garden to the back of the house, it felt very private. There’s even a small secluded patio near the cottage entrance that would be lovely to use in nice weather. I also appreciated that the main house was decorated with little white lights – that made it easy to identify where to turn when coming back in the dark. Great job from a fellow Airbnb host and traveler.'),('6af9152c-e0d7-41fb-95be-b5bfa5bcf432','2017-03-25 02:17:07','2017-03-25 02:17:07','e990e07f-1b6f-4bc5-a553-ddddad30211b','df668e22-e344-4c89-a050-e5ad211cbaa6','Really enjoyed our stay.  Loved sitting out on the front porch enjoying the nice weather we had during our visit to Birmingham.  Thanks Suzy'),('6b368c27-5a44-4e9e-a18a-ef3418e2ccfc','2017-03-25 02:17:07','2017-03-25 02:17:07','b493f8ca-c5d2-414a-9441-6cd4dcebcd36','150e591e-486b-48ee-be42-4aecba665020','This place was perfect! Close to everything with an amazing view. Was a very comfortable stay and had everything you needed. '),('6b9a2d63-6645-45c6-ac84-23cbd7aa73f1','2017-03-25 02:17:07','2017-03-25 02:17:07','598218ba-5069-450d-afe1-1e3212c378d4','85651506-c13c-4c2f-9c79-8fbebc048e39','Berry and Megan\'s place is awesome! Coming home to their bed after being in the parks all day was the best part! Very clean and modern house, and their two little puppies are the cutest! '),('6bd2d8b2-2e01-442f-a1f8-197e0c80aa15','2017-03-25 02:17:07','2017-03-25 02:17:07','dbdc349b-a195-474f-9856-dbe01d08c331','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','Jimmy was a great and considerate host!  A bottle of water was provided in the bedroom and the lights left on at night for me when I came back late.  House and neighborhood were very quiet with quick access to main roads by car.'),('6c309270-1741-472a-8195-a0f172f6fe8a','2017-03-25 02:17:07','2017-03-25 02:17:07','921cd471-9e69-4214-a1f0-014a0a378327','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','Amazing place'),('6c6bd604-aab9-46cc-97fc-0021ec220921','2017-03-25 02:17:07','2017-03-25 02:17:07','38f1bc75-713e-4f09-b02f-d26a4c43ac63','f9b11370-f316-492c-92da-014d7bce7213','5  stars '),('6c779c6f-b1b2-4160-a1b2-005c8ff03306','2017-03-25 02:17:07','2017-03-25 02:17:07','02d9a2b5-7dca-423f-8406-707bc76abf7e','b6160096-c503-4909-a674-7bfbddc8cc45','I was happy to return to The Lynn House for my second stay. Always a pleasure! '),('6d87469a-3e33-43f5-b66e-36c933a358ae','2017-03-25 02:17:07','2017-03-25 02:17:07','52d726db-2427-40ca-a5f0-d5c117625d1c','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Jay is a superb host. He was quick to respond to all questions and offered us many helpful recommendations to ensure we experienced the best Napa has to offer. The house is just as described and photographed. Features we especially appreciated: off street parking, washer/dryer (with detergent, etc), comfortable, clean and modern furnishings, Keyless entry. Had the weather been better we would have taken advantage of the walk to downtown and cute, private patio. '),('6de35cd6-5a30-4b74-9fc9-4a1baa8659da','2017-03-25 02:17:07','2017-03-25 02:17:07','d72f839c-9390-4085-9d39-b45144c9c3c8','61302be9-4b31-4be0-92fc-d0dda253e167','The guest house was exactly what me and a friend were looking for, the price is very reasonable and the scenery is phenomenal. If you enjoy stargazing there is zero light pollution, every constellation was as clear as could be. <BR /><BR />There were several very friendly cats that loved to visit us, one caught us a moth and left it at the doorstep as a gift. <BR /><BR />The description is very accurate, don\'t expect to have a 5-star hotel, just a perfect little home base to lie your head and look at the stars through the window, or curl up with a good book.<BR /><BR />Though we didn\'t bring anything perishable we were pleasantly surprised to find a mini fridge inside in case you have something small that needs to be refrigerated.<BR /><BR />Hope to visit again some day, had a very good experience.'),('6e71f02c-3ee0-4d06-9983-3ee8f1eaa014','2017-03-25 02:17:07','2017-03-25 02:17:07','78ca76e7-78dc-4867-8281-50ab3dc47cdd','f9b11370-f316-492c-92da-014d7bce7213','Excellent space and host.'),('6e84d081-3424-4b68-b354-552936293df3','2017-03-25 02:17:07','2017-03-25 02:17:07','e979e012-bcb1-47ea-bb39-140cdfe0f917','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','We stayed at Clay\'s place while attending a conference at the University of Oregon. Clay\'s place is located in a quiet residential neighbourhood, check-in was simple, bed was very comfortable, lots of privacy, parking spot, and all necessary amenities. Would stay here again!'),('6e8f99bb-5311-48ec-8b77-80156c46cfe6','2017-03-25 02:17:07','2017-03-25 02:17:07','a12e6da9-0797-4445-9626-d5f0fa5ed775','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','We enjoyed our stay at Terry and Sarah\'s place. It was our son\'s birthday and we arrived to find that our hosts had left us lots of little goodies (cookies, fruit, coffee etc) which was an unexpected delight! The property is wooded and very beautiful to walk around on. It is also very near to a couple of parks which was great for us. Oak Mountain State Park is also a short drive away. We would definitely stay at terry and Sarah\'s place again!'),('6ec2c15c-57f1-4fcf-8632-874314959e3e','2017-03-25 02:17:07','2017-03-25 02:17:07','14e9cb05-e188-4e02-ab2c-8ef425e5ea64','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Donna was very flexible and communicated well. She allows your privacy but is friendly and social and respects your wishes either way. I had a need for ironing my shirts and she went out of her way to purchase an ironing board for my needs on her own. The Location couldn\'t be any better from a geography standpoint and like le the quaint Location near a public park and restaurants. '),('6ef01cb4-72a3-44bf-8e0f-f740988f7f59','2017-03-25 02:17:07','2017-03-25 02:17:07','47b9ca37-915d-405d-861d-7dbf74559441','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Carmenita is very nice. She has a very nice home. I would recommend a stay here. It\'s not the closest to the city but you could catch a Lyft and be under $20. The stay is the basement of her house. There are no windows in the bedroom part so keep that in mind. I only stayed for a day but I would come back to her home again. *Bonus points for her huge jacuzzi bath tub. '),('6f35bbf2-54e2-451f-8aa2-59ef9cdbcd60','2017-03-25 02:17:07','2017-03-25 02:17:07','bcda6018-7286-4d8c-abfa-dda1026adf88','d622edfa-fc35-4732-b5ec-a15d794267ec','Winnie\'s place was exactly as advertised! Cannot wait to come back to Sonoma - would stay with Winnie again!'),('6f83f1fa-c7e8-4502-9653-26ef6b909b41','2017-03-25 02:17:07','2017-03-25 02:17:07','02d9a2b5-7dca-423f-8406-707bc76abf7e','887dcd8d-d5ee-48de-9626-73ff4ea732fa','Irene is a relaxed and did extra as a perfect host<BR /><BR />Everything was tip top and comfy'),('6f9044f1-aaac-48fe-9942-6b414beb11e6','2017-03-25 02:17:07','2017-03-25 02:17:07','e551a4a6-7701-41de-be62-aae869888c78','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Laura\'s home is in a safe, friendly, residential neighbourhood close to Bradley University. She keeps her home to a really high standard and is well prepared for guests. The house is lovely and her dog is sweet and friendly, and our room was spacious, comfortable and nicely decorated. Laura was easy to communicate with and helpful, and we enjoyed our stay in her home. '),('6fea0981-112a-4145-92ad-560b0ef99eb9','2017-03-25 02:17:07','2017-03-25 02:17:07','207f5bf6-d1de-4cca-a60d-c2c48e93debc','32c11d3d-99a1-4406-ab41-7b6ccb7dd760','Great house with so much character. Jim went over and beyond what was expected. I\'m a tennis coach and brought my 9 year old and 7 year to compete in a tennis tournament in Meridian. We cooked  meals and enjoyed the house as much as our busy scheduled allowed. Jim\'s house is going to be a real winner on airbnb. I was coaching 8 other families who all over paid for hotels in Meridian and when they saw the room my family had they were extremely jealous. I\'ve stayed in Airbnb\'s all over the world as a professional tennis coach and this was by far the most historic and unique stay I\'ve had. It was also my wife\'s first stay in an airbnb and she was a little apprehensive at first. It took no time for her to get hooked. Glad to know when we travel as a family all of us will pick airbnb! Thanks Jim!'),('7015b240-bf1a-4d5b-b551-e773746a858d','2017-03-25 02:17:07','2017-03-25 02:17:07','c29b5191-ac68-4e9b-a68f-aa42ea1dcb01','3fda0d5c-fea4-4920-bc91-6e6c6663d161','If you ever wanted to be in the heart of a very artsy-gentrification area, this is it--along with a chance to see a community WW II Victory Garden and have coffee and schmooze just down the street from Cayla\'s home-studio-bnb. This is a VINTAGE BUNGALOW with some lovely updates. '),('70d14c8d-bd56-4ec7-b5ad-a2d8af745ba7','2017-03-25 02:17:07','2017-03-25 02:17:07','cff8a023-eacb-4a38-a24f-a01fe9ddde18','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Cara\'s place was perfect for my husband, me, and our 1.5-year-old daughter. She loved running around the yard and eating on the patio. Cara was thoughtful to set out a child\'s table and chairs, and my daughter loved it. We loved pulling her to the beach every morning in the red wagon. Easy driving distance to Whole Foods and great eating options.'),('70e49dc8-082f-4b43-9b80-3f9eb01c86dd','2017-03-25 02:17:07','2017-03-25 02:17:07','7a958fb6-a203-441c-9f8f-3440523fed14','df668e22-e344-4c89-a050-e5ad211cbaa6','Thank you so much for being an amazing host! You were very accommodating and lovely! Thank you so much for making my first Air BNB experience a great one '),('70f1f649-5745-48be-930d-a8390473920d','2017-03-25 02:17:07','2017-03-25 02:17:07','4929d198-149e-437b-b4a1-3ae1ec0044c2','61302be9-4b31-4be0-92fc-d0dda253e167','Very clean, good location! Six minutes to anything you need. House is decorated beautifully. '),('70f8dd89-7969-4d24-b383-043968b4f5e6','2017-03-25 02:17:07','2017-03-25 02:17:07','bb86e624-9ecb-4aca-a713-8cd6984f25a0','70b18dcc-08ef-4040-91cf-4075973d320a','Great place!'),('7182005c-41ce-4250-b545-d92457ad4750','2017-03-25 02:17:07','2017-03-25 02:17:07','60b77ea7-04c9-4b8a-b835-dc92c6aa196b','3fda0d5c-fea4-4920-bc91-6e6c6663d161','We loved this cottage! Great location and amenities.....bikes, beach towels, etc. The hosts are lovely and we really appreciated their attention to detail. Mahalo!!'),('722e1968-590e-48b4-a1c1-fe10222de0b1','2017-03-25 02:17:07','2017-03-25 02:17:07','daa15c1b-9ca6-4042-85fd-bdb7a46d5862','887dcd8d-d5ee-48de-9626-73ff4ea732fa','Quiet and clean place. Fast and helpful response from Mike. He completely leaves you alone which was great (at least for me).<BR /><BR />Definitely will be back when I am back in Saint Paul area.'),('72f668bd-48ab-4a54-abd7-87b2d5cece45','2017-03-25 02:17:07','2017-03-25 02:17:07','1ff1963c-7afa-470c-bc05-562b01549b09','7231eaa1-400f-4cb5-a867-f5eba8adbb81','We loved our stay at Hanan\'s! We were able to rest and recharge after a long day of traveling. The beds are so comfy and the backyard is beautiful! The space was clean and the decor made it feel so homey. We loved the bathroom! Hanan was a wonderful host and made sure we had everything we needed. We could not have asked for a better experience for our first Airbnb stay!'),('737d52de-b347-4552-980a-6181b1c50fac','2017-03-25 02:17:07','2017-03-25 02:17:07','18ff54e2-dc10-4e7f-bfdb-8a7591f7f009','8394fd35-8a8a-479f-a398-48f53b4a6554','Travis was a great host. Super easy to get in and out. Very accommodating!'),('73cf9194-9b58-4bbd-9bc1-644cb8b3815d','2017-03-25 02:17:07','2017-03-25 02:17:07','9a4d1511-f149-485c-a66b-0ca3fa105ad7','30a890e4-a62c-44f9-abc0-07e2c74021da','Cute house. Great host. '),('744f0bd0-c64a-47fb-9cb4-4cf297f1c3d1','2017-03-25 02:17:07','2017-03-25 02:17:07','3827c1d1-14d5-4643-a24b-3dca656192fa','f33e2624-520b-4bc2-