3c9-b851-60c6882abcd3','Very nice room and great neighborhood ! Love it!'),('8e7dac8a-c9e7-4414-b5a1-9047b0d48c30','2017-03-25 02:17:07','2017-03-25 02:17:07','31568a3f-d5b1-47d1-b2ee-74339059e3a0','61302be9-4b31-4be0-92fc-d0dda253e167','Our family really enjoyed this place as a nice break from the cookie cutter hotels. It is a real southern house with a big porch and plenty of room inside and out. Old fashioned would probably be the phrase I would use to describe it. We were only passing through but it would be a great place for a retreat or some time away in peace and quiet. The price was very good. We would definitely stay here again if we were in the area! '),('8e8dfd31-47db-4b36-a4f4-aee0c6f2da10','2017-03-25 02:17:07','2017-03-25 02:17:07','8fba447b-e04f-41c5-a730-848ef02758a9','d622edfa-fc35-4732-b5ec-a15d794267ec','Very comfortable and accommodating.'),('8f00ca2c-ce78-40c2-b669-3b1c73d40a81','2017-03-25 02:17:07','2017-03-25 02:17:07','66fb8e5d-2ad2-44be-8890-a13a9992f257','df668e22-e344-4c89-a050-e5ad211cbaa6','Great place! Clean, eclectic. Very quiet neighborhood. Close to city. '),('8f55cb9d-449e-4744-ba0a-f5455fc164c5','2017-03-25 02:17:07','2017-03-25 02:17:07','e3f28357-a476-4032-8726-4ac7262cbc72','85651506-c13c-4c2f-9c79-8fbebc048e39','My gf and I loved this place, and it was a deal too. Jane was an excellent host: gave great local recs in advance, very friendly all the way through, and totally respected our privacy. This is a bit more than a 1Br/1Ba because the place is outfitted with everything you could want for a short stay (mini fridge, keureg, microwave, toaster oven, and water cooler) and there are TWO step out balconies, one of which is nice and sunny in the morning; so my gf and I enjoyed doing a quick breakfast there before heading out to wineries or wherever. We ended up driving the ~1 mile into downtown Napa the night we did go check it out, but you def could walk. The property is set in a really quiet little suburban section, so very peaceful at night and pretty stars too. We\'ll totally go back.'),('8fc3809b-7d27-44be-9a8c-ece6526f2064','2017-03-25 02:17:07','2017-03-25 02:17:07','b2c8a4cd-6e80-48c3-a1fc-07f129ee2875','f9b11370-f316-492c-92da-014d7bce7213','The house is beautifully decorated, super clean. Very convenient location wise. Absolutely loved every moment of my trip to Birmingham because of this Airbnb experience. <BR />'),('900225c3-87a4-496d-93db-245db3342808','2017-03-25 02:17:07','2017-03-25 02:17:07','e551a4a6-7701-41de-be62-aae869888c78','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Clean, excellent amenities and plenty of \"extras\": snacks, lotions, toiletries. Highly recommended! '),('90acde0e-9783-4b14-b7b6-1b5e6c70e290','2017-03-25 02:17:07','2017-03-25 02:17:07','84f6227b-6c97-47ff-9ede-d4fbf4994d23','00a11245-12fa-436e-9ccc-967417f8c30a','We loved it!'),('90d85c99-7569-4cce-a9e6-4d63a53a761d','2017-03-25 02:17:07','2017-03-25 02:17:07','aaf389be-c794-4fb4-a6cf-619ca956898f','7771bbe9-92ab-46d1-a636-864526361d7d','My boyfriend and I stayed here two nights and could not have had a more positive experience! The cottage is quaint and cozy, everything is updated and a perfect space for two. We were very impressed with the small details in the cottage such as a welcome basket with treats and a sweet note, a plethora of fresh towels, updated amenities, and a list of recommendations in the area. We arrived later in the evening - Easy check in was a breeze! The location is great and within a quick distance to the Plaza, Glen Ellen, and only 40 minutes to Napa. We had no issues, but Melanie was just a quick text away. We had such a great experience and will definitely be back. Thank you Melanie for the wonderful getaway in wine country!!'),('910e4fdd-580a-4dab-9547-7b532f5e5f47','2017-03-25 02:17:07','2017-03-25 02:17:07','89ddd0bc-2250-4094-8f6d-59b35c0f6891','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','This is a gem of a place.  Location is perfect!  A secret stair path to old town shops and yet just far enough away from any late night tourism noise.  Beds are super comfy.  Jen is an exemplary host.  I would not hesitate to stay here again!'),('912ed230-3f64-4e40-9992-04854c14c81c','2017-03-25 02:17:07','2017-03-25 02:17:07','89ddd0bc-2250-4094-8f6d-59b35c0f6891','f9b11370-f316-492c-92da-014d7bce7213','Jennifer was an exceptional host and our stay was so good we did not want to leave! We would recommend it strongly to anyone who is visiting Bisbee. We loved it so much we hope to stay again when we come back!'),('9262023f-1756-4699-b758-a12be1184fb5','2017-03-25 02:17:07','2017-03-25 02:17:07','bb86e624-9ecb-4aca-a713-8cd6984f25a0','70b18dcc-08ef-4040-91cf-4075973d320a','Lovely private accommodations with kitchenette features, lovely bohemian decor, and close to Sonoma wineries. I was able to uber around vineyards instead of paying for a wine tour which was great! '),('9291db19-fc25-4dce-9245-ec7c8487d5d0','2017-03-25 02:17:07','2017-03-25 02:17:07','6a78ec0c-8410-4cbf-a915-e697a3aa798d','85651506-c13c-4c2f-9c79-8fbebc048e39','I was only there for one night but what a great place! '),('9304b57b-4a1f-4607-b061-a927edf799f4','2017-03-25 02:17:07','2017-03-25 02:17:07','b7a46879-c82a-46d9-9ea9-43cbefca2f81','91e27a07-1f47-43c9-b851-60c6882abcd3','Cozy Cottage. Great place for any traveler to stay. '),('93a773e4-3a0b-465a-9b90-7c6889f6b0c6','2017-03-25 02:17:07','2017-03-25 02:17:07','df2548db-377d-422e-b805-4e8e0c794302','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','I have only Airbnb\'d a few times, but this stay was INCREDIBLE. Kevin was a most gracious host, and an absolute pleasure to get to know. Our arrival was in the wee hours of the morning, but he woke up early and let us in to get settled without complaint. In our time there we were able to hang out with him a fair amount, and he was very helpful in guiding us around Birmingham. He also provided us with coffee and breakfast, which was a super kind gesture. The space was immaculate, from the beds to the bathroom. Impeccably renovated, decorated, and cleaned. Should we make our way back to Birmingham, we will ABSOLUTELY be staying with Kevin, and his sweet little dog Remy!'),('93fba918-fd6c-4e2e-9dc1-4c41709e3c90','2017-03-25 02:17:07','2017-03-25 02:17:07','a16c7358-bf66-4802-8933-1616b5a322db','426624f6-84a9-4ec4-84f3-7655dc70e86e','Very much enjoyed this cute spot.  Nicely appointed, clean tidy feel.  Highly recommend '),('94a92bd6-8f1f-4cbb-af83-364ed6f441b9','2017-03-25 02:17:07','2017-03-25 02:17:07','52cc10db-af9b-499c-aa8e-670056611a7c','32c11d3d-99a1-4406-ab41-7b6ccb7dd760','If you want plenty of dining options nearby, this is your place!  State street in Fondren has  a great food option for every taste. Met Kelly in person and she\'s great.  Thanks Kelly! '),('9520fa62-6eb4-4220-b3c3-d7b2244fb22a','2017-03-25 02:17:07','2017-03-25 02:17:07','e990e07f-1b6f-4bc5-a553-ddddad30211b','7771bbe9-92ab-46d1-a636-864526361d7d','Great home and host! The porch is absolutely wonderful with a great view of downtown Birmingham at night. On a quiet street. Would definitely recommend! '),('95250535-dcde-48bb-a12f-848df205333f','2017-03-25 02:17:07','2017-03-25 02:17:07','daa15c1b-9ca6-4042-85fd-bdb7a46d5862','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Mike\'s apartment is great! Very clean and comfortable! Great location within walking distance to lots of fun bars and restaurants. We had so much fun, would definitely recommend his place to anyone going to St. Paul!'),('95508e12-2253-4150-9cd5-4261ad56fe0f','2017-03-25 02:17:07','2017-03-25 02:17:07','89ddd0bc-2250-4094-8f6d-59b35c0f6891','30a890e4-a62c-44f9-abc0-07e2c74021da','A wonderful experience. Plenty of room for two couples and a baby. Easy walking to restaurants, shops, and landmarks of Old Bisbee. Jen was a wonderful host, and even brought over some of her daughter\'s toys for my daughter to play with when we were there.  We\'ll certainly be back.'),('9591cafb-932a-4bda-b8b9-fd0792cc355c','2017-03-25 02:17:07','2017-03-25 02:17:07','d3fc84bb-8ccd-4457-99a8-91dda88dc64d','30a890e4-a62c-44f9-abc0-07e2c74021da','Good location, excellent price. Good deal'),('95935cb0-1d07-45d3-93ed-c66b86744635','2017-03-25 02:17:07','2017-03-25 02:17:07','610ef600-53da-4e05-aaaf-b7ae4d14fcfb','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Loved the location on Grand Ave.'),('95c15541-bd96-4ab1-9deb-94b05efbcb7c','2017-03-25 02:17:07','2017-03-25 02:17:07','dce54621-9083-4cd9-9335-a9e8861289d8','150e591e-486b-48ee-be42-4aecba665020','Perfect crash-pad for a trip to SF. This place is walking distance from just everything, and the restaurant and cafe on the bottom floor are superb.'),('95dd6a92-88c4-4d6c-8b8d-860656b937e2','2017-03-25 02:17:07','2017-03-25 02:17:07','ad124633-a610-483f-862a-6f54dda19c6e','91e27a07-1f47-43c9-b851-60c6882abcd3','Lida was a nice host. <BR />It\'s a cheap place, but it\'s not the biggest one.<BR />'),('961cc8cc-2b68-4c03-8288-cd51775dfc1a','2017-03-25 02:17:07','2017-03-25 02:17:07','817bcb43-ba39-4925-aed6-76be4bed946b','00a11245-12fa-436e-9ccc-967417f8c30a','JJ\'s brother, Tom, was a great host. He made our stay at this Bnb very pleasant. Only issue was parking, which was a bit difficult to find, and we had to park a couple of blocks away from the house'),('963dea2d-abae-47f3-a177-fda7407b8179','2017-03-25 02:17:07','2017-03-25 02:17:07','552b5aaf-33b7-407b-a2dc-459ab730b3a5','df668e22-e344-4c89-a050-e5ad211cbaa6','Annie is a great host and the place is brand new. Centrally located and walking distance to a lot of great restaurants and stores. Parkings can be troublesome at times but that\'s similar in any city setting. '),('96a07a1f-d437-4398-9a31-36241379b972','2017-03-25 02:17:07','2017-03-25 02:17:07','66fb8e5d-2ad2-44be-8890-a13a9992f257','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','My husband and I travelled to Portland for the first time and Naomi\'s house was absolutely wonderful in every way. Located in Beaverton, just a short drive from downtown and the airport, it was a quiet escape nestled on the end of the street in a nice neighborhood. We rented a car, so the drive downtown was super quick and easy but there is public transit as well. The house itself was perfect for us because we like to cook, so the kitchen had everything (and more) that we needed to whip up a meal. There are tons of games and cards to play during a fun night in front of the cozy fireplace. Also, the bed was the most comfortable we\'ve ever slept on, even more than our bed back home. It\'s not often you stay in an airbnb and think, \'gosh, I wish this were my home.\' We would highly recommend Naomi\'s place to anyone looking for a cozy getaway in a beautiful city.'),('97218304-bb8e-40c0-812c-d264180b2407','2017-03-25 02:17:07','2017-03-25 02:17:07','e6c33577-5de3-4481-9147-47ef4710b986','7771bbe9-92ab-46d1-a636-864526361d7d','Joanna and her family are great hosts! We had a very warm welcome and a super stay at their house. We are happy to be back soon! Thank you!'),('9744f05e-c04b-4578-9941-8af259b2b9f6','2017-03-25 02:17:07','2017-03-25 02:17:07','610ef600-53da-4e05-aaaf-b7ae4d14fcfb','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Lauren\'s place is the perfect little apartment for a nice get away in St. Paul! 10/10 would recommend. Thanks for everything! '),('979cd355-c3a2-41c3-adc2-c3cca6c9e29d','2017-03-25 02:17:07','2017-03-25 02:17:07','bb86e624-9ecb-4aca-a713-8cd6984f25a0','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Very quiet and easy to get to vineyards'),('9825ef7d-252e-4c2d-a511-8f315cd13206','2017-03-25 02:17:07','2017-03-25 02:17:07','df2548db-377d-422e-b805-4e8e0c794302','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Kevin was a thoughtful and good host. The room and apartment were very nice and clean! The room is subject to the weather temp, so keep this in mind if visiting during cold or hot seasons! '),('98328190-4428-473a-9cd2-5269a040f4ad','2017-03-25 02:17:07','2017-03-25 02:17:07','6d24beec-f296-473c-a34a-4dd9aab8a780','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Great location and comfortable digs! '),('98395e5f-654e-4eb0-881e-e4ed73073304','2017-03-25 02:17:07','2017-03-25 02:17:07','b6692019-ac4a-47aa-a671-89cd79c9e11f','fa44780d-ac48-41ab-9dd0-ac54a15755cf','Mason was easy to reach and friendly. Our checkin process was very easy. The apartment itself is not near a lot, but it was a short Lyft to downtown where there were lots of bars and restaurants to check out. The apartment has everything you need, was comfortable clean and ready for us. I would recommend staying here, especially if you\'re going to see a concert at Syndicate Lounge like we were! '),('9853d6c7-6875-4f74-ac6b-628ac114c281','2017-03-25 02:17:07','2017-03-25 02:17:07','328bd785-a91b-424c-afda-9e08e5155cfe','f9b11370-f316-492c-92da-014d7bce7213','Bryan was a very nice host and the stay was good. Downtown is a short drive away and you get a lot of recommendations for food.'),('98ca6ce3-e98d-4d66-a1d7-3aaca65694a0','2017-03-25 02:17:07','2017-03-25 02:17:07','b6692019-ac4a-47aa-a671-89cd79c9e11f','32c11d3d-99a1-4406-ab41-7b6ccb7dd760','Mason\'s listing was completely accurate. Great place to crash for a night and you cant beat his rate. '),('991e0172-0884-4ba6-a952-aa512c29c339','2017-03-25 02:17:07','2017-03-25 02:17:07','bc227cc3-0ad7-4b9a-b72a-6c2a45e6a88a','00a11245-12fa-436e-9ccc-967417f8c30a','The hospitality was great. They let us checkin a few hours early because no one stayed there the previous night. Special thanks to them for that. The house is beautiful. The location is safe. We rented the house for 3 nights for a reunion and it was so much fun. Everyone loved the house. I would recommend this to anyone who is looking to rent a house in the suburb. '),('995bfb29-056d-4f8b-983d-7efbcf10a853','2017-03-25 02:17:07','2017-03-25 02:17:07','1ff1963c-7afa-470c-bc05-562b01549b09','9eec6c06-5918-4867-833a-face490d4715','Favorite BNB so far :) very comfy, super cute, good location, great host, can keep going on.... would definately recommend for a girls\' trip to Napa! Can accommodate 4--we enjoyed for just 2 and had plenty of space. Hope to visit again!'),('99b57fd1-5bb5-42e9-80c8-e3200481db26','2017-03-25 02:17:07','2017-03-25 02:17:07','4ae40c33-23c9-47a9-b867-0a6d8f25fd8c','cf1780e6-d294-4113-8749-1c728b9e3f81','Barbora\'s place was perfect! She is so awesome. Fast communication and really willing to work with you on check in/check out. Place was perfect!! Very accurate. We loved our stay! '),('9a3d993f-387a-46d1-a87c-91c5038618bd','2017-03-25 02:17:07','2017-03-25 02:17:07','279b355e-ff9a-4b85-8114-6db7ad2a4cd2','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Great value in a great location! This little guest house is a great alternative to paying very high prices for a hotel in this area. Check-in was very easy and we were even able to check in a bit early. It felt private and comfortable and the space was clean. All of the basics were available. The bedding was comfortable and we loved that there were extra pillows. The only minor issue was that there was only one set of towels so one of us had to use a damp towel. It was a very good experience overall and we would both recommend it to others and stay there again. '),('9abb9a35-9463-4e8f-9888-8b8a8ab703d2','2017-03-25 02:17:07','2017-03-25 02:17:07','3ebfaf23-cede-4cf0-964d-8afc17b11d02','30a890e4-a62c-44f9-abc0-07e2c74021da','Adorable cottage in a beautiful neighborhood.  Jan was very accommodating and friendly.'),('9ad7d57f-66fb-4da7-a2f3-5bd2901b2997','2017-03-25 02:17:07','2017-03-25 02:17:07','598218ba-5069-450d-afe1-1e3212c378d4','df668e22-e344-4c89-a050-e5ad211cbaa6','Excellent room with comfortable bed & bathroom. Everything was clean and hygienic. Very quite place and i would definitely repeat again. '),('9aebc996-91bb-4664-8674-1924ca2a7d52','2017-03-25 02:17:07','2017-03-25 02:17:07','18ff54e2-dc10-4e7f-bfdb-8a7591f7f009','30a890e4-a62c-44f9-abc0-07e2c74021da','Travis was extremely flexible with my arrival time. Travis and his friend helped get my bags out of the car, and another friend made me a nice beverage. I felt very welcomed. <BR /><BR />I enjoyed the comfort of the bed and I guess we got lucky and booked on a weekend where we were the only guests, which was great for us because we did not have to share the bathroom with any other guests.<BR /><BR /> I would stay again.'),('9b46cba5-61b2-401e-aec9-1d1fe039d5c8','2017-03-25 02:17:07','2017-03-25 02:17:07','b13b1a74-3a12-4f00-8c19-273cbedc0eaa','df668e22-e344-4c89-a050-e5ad211cbaa6','Great Place.  Great Location.  Loved the patio for morning coffee.  Very well equipped'),('9b494e60-758f-4a85-803b-759bf694adc8','2017-03-25 02:17:07','2017-03-25 02:17:07','645127dd-38b4-4fad-9950-57b3ce0a5301','85651506-c13c-4c2f-9c79-8fbebc048e39','Not bad for a quick in and out stay. I was unaware before I got to the house that the only parking options were to take a chance on a parking ticket or park 3 blocks down in the cold and walk back (don\'t forget anything), I took a chance on the parking ticket. The head of the bed had a decline so that your head it tilted backwards and the flat pillows did not help. To bedroom was up against the living room/bedroom and could hear much of the voices and music and feel the bass. As well the only access to the bedroom was through the dining room which the residents were using with friends around 8/9pm and were not regarding any noise concerns.  '),('9b8a6325-16cf-489f-89ef-9bd5085b8c7e','2017-03-25 02:17:07','2017-03-25 02:17:07','14e9cb05-e188-4e02-ab2c-8ef425e5ea64','426624f6-84a9-4ec4-84f3-7655dc70e86e','Donna accommodated our very last minute request for which we were grateful!  She was welcoming and very responsive.  Our room was comfortable, and the house located near a park, co-op, and coffee shops with easy access.  I recommend Donna and her home.'),('9b9138e7-188f-4b53-8f9f-9f589a5c079f','2017-03-25 02:17:07','2017-03-25 02:17:07','e74201c2-6057-419d-be22-d0087eeb4179','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','Very warm welcome. Sherry has helped us in the last minute and offered her beautiful place to stay as our flight has been rescheduled. Big thanks to her and her lovely daughter. '),('9cdd411e-638d-48ce-8b87-221b8111fba4','2017-03-25 02:17:07','2017-03-25 02:17:07','19ae5055-f503-499d-a64f-2bf7d92eff5b','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Great spot, everything as described. Good base for exploring Denver, sleeping in, relaxing. Neighbors seemed friendly. Would definitely stay again.'),('9ce0ece8-0ee8-47e6-a7a0-5c0b84961796','2017-03-25 02:17:07','2017-03-25 02:17:07','695c0586-3345-4b15-bcf7-f5ecbae258e1','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','This apartment is small but is clean, modern and has everything you would need. The room was a good size and the bed was very comfortable. There were nice finishing touches such as good quality towels and toilet paper. The host was not staying there so we did not meet Veronica but her communication was fine. There are two bedrooms and both are rented out through Air BnB so there was another couple staying there while we were there.'),('9d346eff-980f-47b0-bb9c-6f11ec6e5a09','2017-03-25 02:17:07','2017-03-25 02:17:07','314b188e-990b-423e-ae63-f0199b8c2b17','00a11245-12fa-436e-9ccc-967417f8c30a','The spot is so cozy and quiet! We loved the patio and the warm bed. Perfect if you just need a place to sleep or soak up some sun.'),('9d9a1660-0366-40f4-8ad5-5a0d97d08405','2017-03-25 02:17:07','2017-03-25 02:17:07','552b5aaf-33b7-407b-a2dc-459ab730b3a5','61302be9-4b31-4be0-92fc-d0dda253e167','Annie was an excellent host. She was quick to respond and helpful in her communications. The place was well equipped and she even provided extra toothbrushes, shampoos, and a helpful guidebook. Location can\'t be beat, in the heart of Chinatown, just a couple blocks from the restaurants. '),('9e876915-5e76-4315-b34d-82183b404e87','2017-03-25 02:17:07','2017-03-25 02:17:07','7354ea6c-3c0e-4800-aad8-708c29a6c067','8394fd35-8a8a-479f-a398-48f53b4a6554','We wanted to stay in Ewa and it met all our expectations. '),('9f0805a8-ee4b-4611-ad4a-4bced38733c5','2017-03-25 02:17:07','2017-03-25 02:17:07','73544fd5-d823-4435-b0ce-854f3b2695c4','df668e22-e344-4c89-a050-e5ad211cbaa6','Mary Amelia\'s AirBNB exceeded all expectations I had. It\'s a fantastic location and a comfortable space that has been thoughtfully designed. I would gladly stay again.'),('9f083e8e-d33e-440c-8a86-3ec8fa7b31f4','2017-03-25 02:17:07','2017-03-25 02:17:07','af92250e-2f85-4fca-8c04-03029a1b1fad','85651506-c13c-4c2f-9c79-8fbebc048e39','Vincent was very accommodating. He made us feel at home. His home is very clean and the bed slept wonderful. We would definitely stay here again!'),('9f48220f-34e0-4612-8197-c8d32e1c6245','2017-03-25 02:17:07','2017-03-25 02:17:07','b7a46879-c82a-46d9-9ea9-43cbefca2f81','61302be9-4b31-4be0-92fc-d0dda253e167','You Will Not be disappointed in this Very Nice Cottage....<BR />With All the descriptions Barbara has posted......she left off the Skylights & Ceiling fan!!! <BR />For Price & Location in Eugene, It Is GREAT!!!'),('9f5c1bdc-b99a-4aad-b36b-96e50e963691','2017-03-25 02:17:07','2017-03-25 02:17:07','18ff54e2-dc10-4e7f-bfdb-8a7591f7f009','887dcd8d-d5ee-48de-9626-73ff4ea732fa','Travis is a generous host who knows his city very well, and is willing to spend time to help you learn about the area and get to where you want to go. The room was clean and comfortable, and the kitchen well equipped enough to do some basic cooking, and cleaning up. There is a lovely front porch swing to sit on and chat, or just watch the city. This home near the university is within walking distance of a big beautiful city park that we visited all three days we were in town. We loved the security system on the door because we didn\'t have to worry about carrying an extra key. Dependable off street parking is a plus too.'),('9f7cf49d-9b8b-4e4f-8b5a-356cd8854201','2017-03-25 02:17:07','2017-03-25 02:17:07','1385324e-d727-475c-ad30-f7dcb5afea02','887dcd8d-d5ee-48de-9626-73ff4ea732fa','The host canceled this reservation 39 days before arrival. This is an automated posting.'),('a072c086-9245-4868-a215-bb1b71c012dc','2017-03-25 02:17:07','2017-03-25 02:17:07','38f1bc75-713e-4f09-b02f-d26a4c43ac63','f9b11370-f316-492c-92da-014d7bce7213','I will come again'),('a0c2458b-1bb7-454c-a4d7-1861b73ada04','2017-03-25 02:17:07','2017-03-25 02:17:07','8835ba11-7757-45c6-9138-f7e2e4b5f80f','61302be9-4b31-4be0-92fc-d0dda253e167','Nice cozy place to stay near Kailua beach.<BR /><BR />Sometimes (SENSITIVE CONTENTS HIDDEN) Maps has difficulty finding the place.  I found the iPhone maps more accurate.'),('a16fb6fe-96a7-4518-b42e-f9b3a46513ca','2017-03-25 02:17:07','2017-03-25 02:17:07','b493f8ca-c5d2-414a-9441-6cd4dcebcd36','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','See '),('a1c89479-8983-4038-be36-895608883d78','2017-03-25 02:17:07','2017-03-25 02:17:07','e979e012-bcb1-47ea-bb39-140cdfe0f917','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Located in a quiet, residential area about 15\' drive to downtown where there are lots of choices for eating or pubbing or seeing a movie. Host has a very well behaved bigger dog who was just as welcoming as Clay!'),('a1d31adc-2450-4194-b164-c1f141a0b76e','2017-03-25 02:17:07','2017-03-25 02:17:07','3c7eb6bc-a146-4186-bfbf-9de857286e68','30a890e4-a62c-44f9-abc0-07e2c74021da','Great views, clean house, walking distance to just about everything Bisbee has to offer. Can\'t say enough good about Naomi and Frank and there Opera House! '),('a2301ce4-b9a4-42a9-8113-0b4301e36df6','2017-03-25 02:17:07','2017-03-25 02:17:07','d3fc84bb-8ccd-4457-99a8-91dda88dc64d','d622edfa-fc35-4732-b5ec-a15d794267ec','Good place to stay in the heart of Miami. Close to various events.'),('a249f110-c2e3-48ed-8e90-14364ea89768','2017-03-25 02:17:07','2017-03-25 02:17:07','b493f8ca-c5d2-414a-9441-6cd4dcebcd36','df668e22-e344-4c89-a050-e5ad211cbaa6','Melanie\'s suite had everything we needed. The place is cheerful, spacious and comfortable. The huge deck was a major plus! A great place to stay while exploring Bisbee. Thanks Melanie! And Kathy, who was available for us as well!<BR />Sam & Sara'),('a24ada0a-8c6c-4cec-9b75-547660cbdc70','2017-03-25 02:17:07','2017-03-25 02:17:07','a12e6da9-0797-4445-9626-d5f0fa5ed775','91e27a07-1f47-43c9-b851-60c6882abcd3','This place is delightful. It is exactly as described and so wonderfully secluded. Terry and Sarah were so kind to us, and even left special snacks and toys for our young daughters. I\'d recommend their guest house to anyone traveling, and plan to stay again in the future. '),('a27f42d2-d833-4ce6-8913-56866fb45593','2017-03-25 02:17:07','2017-03-25 02:17:07','e990e07f-1b6f-4bc5-a553-ddddad30211b','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','Great place - we came on a business trip and had plenty of space to work together while being able to have some privacy. Beautiful view of the city at night on a gorgeous porch. Suzy is an easy host to work with and we\'re hoping to be back in BHM soon!'),('a2fa5e46-4476-4ee7-9eb6-6f0c10d2c008','2017-03-25 02:17:07','2017-03-25 02:17:07','96233d68-319e-4ae0-a20f-3af55dcadb0a','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','Room smelled nice very clean.  Thorough instruction given on how to check in.  Brickell responded to questions in timely manor.  Would definitely stay again.  Thank you.   '),('a3152321-c654-49ee-a1df-d40649c48e5b','2017-03-25 02:17:07','2017-03-25 02:17:07','478d6061-fc78-40c3-a1b2-0e906fb86da8','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','Tiger is awesome. The place was awesome. Would stay there again. '),('a3439455-add9-46f7-813b-d6bdd4d7c1ac','2017-03-25 02:17:07','2017-03-25 02:17:07','3827c1d1-14d5-4643-a24b-3dca656192fa','7771bbe9-92ab-46d1-a636-864526361d7d','Our stay at Chantal and Cortez\'s home was perfect. Great communication with Chantal and we were made to feel at home straight away. I had the best nights sleep in the super cosy bed (it was like sleeping in a cloud!). Would most definitely stay here again!!!!'),('a371390a-2990-4b42-b06c-7386857a8a09','2017-03-25 02:17:07','2017-03-25 02:17:07','0a454f9a-eaac-488b-8443-23cf58f7ae37','61302be9-4b31-4be0-92fc-d0dda253e167','Pam\'s place by far the BEST airbnb experience. Everything exceeded my expectations. The place was very clean, quiet and I felt very safe there. The place is less than 2 mins walk to the beach access. It is located in a very safe residential neighborhood. It was so peaceful and quiet. It was the best. Thank you Pam!'),('a39f474d-edf9-445b-84a2-cfe0ae2bc772','2017-03-25 02:17:07','2017-03-25 02:17:07','b13b1a74-3a12-4f00-8c19-273cbedc0eaa','91e27a07-1f47-43c9-b851-60c6882abcd3','Just enough steps to take you off the bustle of Main Street! Juan\'s secluded hideaway is clean,  hospitable, and convenient to Bisbee\'s charms!'),('a47aa6be-9a28-4d6b-8010-8c3024e46284','2017-03-25 02:17:07','2017-03-25 02:17:07','ff46f903-411b-4a16-8e16-1aab7f00686c','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Tiffany & Ryan, Thanks for allowing us to stay at your place in Bisbee! We enjoyed all the amenities from the room, balcony overlooking the city, record room, kitchen and pleasant other guests. We will see you again! Best Wishes!! Barton & Lesle'),('a49f6a25-dde6-43a2-9cd8-964ff6da48a9','2017-03-25 02:17:07','2017-03-25 02:17:07','2b6e6650-5f69-426d-a084-71f7ad30d1f1','85651506-c13c-4c2f-9c79-8fbebc048e39','Just perfect. Spotlessly clean, charming, thoughtfully appointed, close to everything. And quiet, with just the cooing of the doves to wake you. A completely wonderful experience.'),('a4c5d230-7ea0-43e5-a17c-9ca2b8f4edf6','2017-03-25 02:17:07','2017-03-25 02:17:07','4ae40c33-23c9-47a9-b867-0a6d8f25fd8c','3ea61b06-e22a-459b-bb96-d900fb8f843a','Exactly as advertised. Beautiful little modern studio with panoramic views of the ocean, canal, and city. It even has a view from inside the shower! Would definitely recommend this spot for any couple or solo traveler looking to avoid the big resort scene. Barbora was a great host and very easy to communicate with. No complaints!'),('a528583b-baa9-4825-a1ed-ab4c318941fd','2017-03-25 02:17:07','2017-03-25 02:17:07','e6c33577-5de3-4481-9147-47ef4710b986','61302be9-4b31-4be0-92fc-d0dda253e167','My first time using Air B&B. If you are looking for a place to sleep and friendly chatter in the evening this is the place for you. The hosts are very friendly, even offered me dinner!! Coffee in the morning and did some laundry for me. Wow what a great find! Close to airport and Pearl Harbor '),('a555c150-329b-490b-9153-900ad387f49f','2017-03-25 02:17:07','2017-03-25 02:17:07','30e56424-c0f0-4e36-9523-f5e904bb3142','30a890e4-a62c-44f9-abc0-07e2c74021da','This is a most memorable, delightful place to stay. It was cozy, comfortable, very clean and decorated with a loving, artistic eye. The bed was like a nest. The flat screen TV was a plus, along with lovingly kept chickens and kitties outside. A darling wine train makes a visit just past the fence once (not during the night). Tom and Judy are lovely, welcoming hosts who are very prompt and easy to communicate with. They gave us a great restaurant suggestion as well. It was very close to restaurants and the Uptown Theatre in Napa.'),('a7324bc4-45f7-43ae-aaf9-1bc680f6d48f','2017-03-25 02:17:07','2017-03-25 02:17:07','98b1678d-d25c-476a-b6c3-c11978617e90','fa44780d-ac48-41ab-9dd0-ac54a15755cf','Very kind, great stay. highly recommended. '),('a7c41810-4c6e-4d6f-96a4-f7366dd0ef30','2017-03-25 02:17:07','2017-03-25 02:17:07','89ddd0bc-2250-4094-8f6d-59b35c0f6891','df668e22-e344-4c89-a050-e5ad211cbaa6','Great place with wonderful light and magical yard. Quiet but two minute walk to Bisbee Main Street. Loved the vinyl records and player.'),('a7cf3058-b7c4-421a-8c23-4cca07629545','2017-03-25 02:17:07','2017-03-25 02:17:07','9247dcc1-711a-4ab2-b99a-f2808627d2f2','61302be9-4b31-4be0-92fc-d0dda253e167','A nice historic plantation house to stop off on our way to New Orleans! My kids enjoyed the 2 flights of stairs to our room and the creaky sounds. Also, the elf door leading to the bathroom from the hallway and the claw foot tub. The hosts were super friendly, we enjoyed learning about the Cajun\'s natural mosquito repellant and hearing the accordion in the morning at breakfast.'),('a8863430-4bfb-41a5-bd9a-a6f28048b933','2017-03-25 02:17:07','2017-03-25 02:17:07','ffcc9c22-759e-4418-b788-81eda89c2865','150e591e-486b-48ee-be42-4aecba665020','Very clean and comfortable. The hosts are kind and welcoming. As private as could be for a shotgun-style house. About a 15-30min walk to the French Quarter through a pretty and safe residential neighborhood.'),('a9f706be-6e25-4647-9ea4-d9ab763fb56a','2017-03-25 02:17:07','2017-03-25 02:17:07','a16c7358-bf66-4802-8933-1616b5a322db','91e27a07-1f47-43c9-b851-60c6882abcd3','This looks even better in person, very quiet, full kitchen and close to shops/ restaurants, highly recommended'),('aa14468c-ee91-4bbb-9154-8cbb7f9f90c1','2017-03-25 02:17:07','2017-03-25 02:17:07','b4d6d884-e50d-41eb-9b97-6395a07a43f9','7771bbe9-92ab-46d1-a636-864526361d7d','We loved staying with Alex and Bethany, they are a very nice and hospitable couple, we felt very warmly welcomed! Their place is a darling wine country home, we had our own room and bathroom right next door. Super clean, detailed. Had everything we needed and more!! Read the house manual and guidelines, they every question answered!! Also like that they are a permitted rental host! They suggested some great restaurants and wineries also, everything was very accessible by uber!! Will definitely stay again next time we are in Napa, hopefully sooner than later! :)'),('aa573951-535a-4b18-bf0b-b78235bef1ed','2017-03-25 02:17:07','2017-03-25 02:17:07','b56cb489-da79-4028-bcc0-7251324606f0','f33e2624-520b-4bc2-b6a0-190ee1d41855','Jim and Maki\'s place was great, they are wonderful hosts, they made us feel welcome, and woke up everyday with an excelent breakfast. =P\n<BR />The place was clean,the beds comfy, and provide us with towels, beach chair, etc.\n<BR />The location was ok, it\'s an easy drive anywhere. The jacuzzi was always ready to use, clean and with hot water, to relax after a long beach day.\n<BR />Jim and Maki are beyond friendly and accommodating, which made  our stay exceptional.\n<BR />It is a great place to stay, and I highly recommend it for anybody.'),('ab703c89-9254-49ae-b165-a70f837d560e','2017-03-25 02:17:07','2017-03-25 02:17:07','66fb8e5d-2ad2-44be-8890-a13a9992f257','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','This house was perfect for us. Very cozy and clean. Quite and secluded. Not far from the center city and filled with decor that fit our style. Would definitely stay here again!!'),('abc3b836-1e8a-45e8-9cbe-47df570718b0','2017-03-25 02:17:07','2017-03-25 02:17:07','f19fa153-154e-440b-9f4b-debee403b0d2','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Kathleen\'s home is in a nice suburban area of Naperville, only about a mile from the downtown area. Kathleen herself is a fantastic hostess and was very easygoing about our stay. We had an odd check-out time (which was one of our main concerns), but she was able to accommodate our exit extremely well. Many Airbnb hosts simply rent out a room, but Kathleen goes above and beyond to make sure the stay was special. She had tidied a bed for us, laid out some snacks, and showed us where everything in her house was for easy access. She made sure we were comfortable, which is something I appreciate in a host. She was also very easy to get along with.<BR /><BR />Her house itself was very nicely designed and I thoroughly enjoyed being in that space. It was easy to settle into and she made sure everything is great for her guests. If you\'re looking for a place in the area, I\'m sure Kathleen would be the best option. You won\'t regret it.'),('ac4e6473-e2cf-4fb3-a68d-16b7b4615e4d','2017-03-25 02:17:07','2017-03-25 02:17:07','d8a2b39f-6174-4f1f-a14a-561a81cabce2','cf1780e6-d294-4113-8749-1c728b9e3f81','This little place has a beautiful property and is quiet. We enjoyed our stay'),('ac579759-8c19-4b08-a791-e95845b99ec4','2017-03-25 02:17:07','2017-03-25 02:17:07','1385324e-d727-475c-ad30-f7dcb5afea02','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','EEverything was very well kept and clean. Definitely would recommend it to others'),('ac8243c0-5617-489f-b51b-3b75dcc906f5','2017-03-25 02:17:07','2017-03-25 02:17:07','5463e312-5bf4-4764-8c06-e97c5548f712','df668e22-e344-4c89-a050-e5ad211cbaa6','Megan\'s place was exceptionally clean and well equipped for a nice and restful evening. I was on a bicycle tour and found the room and supplies to be of great benefit for my travel needs. It was also very easy to get to the Natchez Trace across the city from her location. '),('ace32c8c-80ce-4d6f-a6a6-74fbae919f4a','2017-03-25 02:17:07','2017-03-25 02:17:07','71641595-0021-4007-8e89-2bb776cbf6f5','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Beautiful home.  Excellent location downtown.  Laird was a great host.  A+ recommendation if you are staying in Greensboro.'),('ad3c8800-a32a-45fa-8ab5-2432e10d1259','2017-03-25 02:17:07','2017-03-25 02:17:07','b7a46879-c82a-46d9-9ea9-43cbefca2f81','8394fd35-8a8a-479f-a398-48f53b4a6554','Barbara\'s place was an absolute pleasure as usual. Cozy and comfortable, just what I needed. Thank you!'),('af30a889-d727-4599-9f17-f819db43cd0c','2017-03-25 02:17:07','2017-03-25 02:17:07','ae787938-171f-4563-8c75-92a037fed415','f33e2624-520b-4bc2-b6a0-190ee1d41855','Hannah & Richard\'s home was lovely, and the room was very comfortable. I was able to walk to the Historical Society and get back down to the Union depot easily.  Everything was really nice, and Richard and Hannah were very flexible and wonderful hosts!'),('af6eefb3-26df-48da-81f9-1840e81ee910','2017-03-25 02:17:07','2017-03-25 02:17:07','e551a4a6-7701-41de-be62-aae869888c78','85651506-c13c-4c2f-9c79-8fbebc048e39','In one word: HOME. Absolutely would return again. Kind, warm and accommodating. It is a 3 minute walk from where the Peoria Charter drops you off on Bradley University Campus. Super spacious and comfortable bed. Little details count and she did a great job. Snacks and toiletries were provided in very thoughtful way. The key system indicating what is for AIRBNB use is genius. Thank you for the tea... and I can\'t forget to say thank you for letting Chase (the dog) hangout with me. '),('afd3892d-ea9d-463c-a418-0520aeff9eed','2017-03-25 02:17:07','2017-03-25 02:17:07','dce54621-9083-4cd9-9335-a9e8861289d8','887dcd8d-d5ee-48de-9626-73ff4ea732fa','Very affordable and in the middle of downtown!'),('afe2d932-1f8b-4cc2-8e0b-416c891cb80c','2017-03-25 02:17:07','2017-03-25 02:17:07','817bcb43-ba39-4925-aed6-76be4bed946b','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Good. Location <BR />Friendly person, we recommend this place. we friendly persons , the bedroom with all the basic stuff that we needed. '),('affde9b5-9b54-466c-bd03-ed9f5c081b22','2017-03-25 02:17:07','2017-03-25 02:17:07','9a4d1511-f149-485c-a66b-0ca3fa105ad7','00a11245-12fa-436e-9ccc-967417f8c30a','Rachels place was just perfect.  We enjoyed sitting outside with our coffee and the location to all local attractions was perfect.  I recommend when you\'re visiting Lafayette'),('b0bdb854-c30e-408d-8d2f-db682a7a29f9','2017-03-25 02:17:07','2017-03-25 02:17:07','e74201c2-6057-419d-be22-d0087eeb4179','61302be9-4b31-4be0-92fc-d0dda253e167','Sherry is very nice and her house is comfortable. She is quick to welcome you into her home and offer you anything you need. And her dogs are pretty cool too, especially Buddy. Multiple people stay here for different lengths of time, but everyone is friendly and mostly keep to themselves. I would definitely recommend any of the rooms here to anyone traveling to Oahu. '),('b0e8c576-4abd-4922-9a03-cae3d05ffa21','2017-03-25 02:17:07','2017-03-25 02:17:07','1ff1963c-7afa-470c-bc05-562b01549b09','7231eaa1-400f-4cb5-a867-f5eba8adbb81','We enjoyed our stay at the Napa apartment. It\'s a bright and clean apartment and the bed was comfy. It\'s close to a lot of restaurants and the drive through Napa Valley. Hanan provided a booklet of information on the local food scene which was perfect and made for easy meal planning. '),('b13e6e1c-8eac-43b7-a180-2ba4d0acde8e','2017-03-25 02:17:07','2017-03-25 02:17:07','9c7d3ecd-9592-4910-bd04-91c59e8350f1','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','The pool house was nice, great part of town. Probably awesome in spring/summer!'),('b15c5cd2-3a6c-4956-bf6e-f1eb8885be1b','2017-03-25 02:17:07','2017-03-25 02:17:07','8c2f2c57-a172-4689-a070-cbb4cd456c5c','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Great hosts, comfortable home :)'),('b17e0703-6ad0-4a24-bc5a-b18fc4638e33','2017-03-25 02:17:07','2017-03-25 02:17:07','859a8a8f-9423-4bf6-b471-d9a7f39c9c2c','fa44780d-ac48-41ab-9dd0-ac54a15755cf','Absolutely wonderful place!!! The only bad thing was that we couldn\'t stay longer. Incredible hosts that feel like old friends and the location is beautiful. House is lovely and decorated beautifully- plenty of coffee which is always a good sign (: '),('b185aaeb-e4b2-4902-b912-7e24b434ebcd','2017-03-25 02:17:07','2017-03-25 02:17:07','30e56424-c0f0-4e36-9523-f5e904bb3142','f9b11370-f316-492c-92da-014d7bce7213','Great spot! '),('b1e50c83-ec07-46b7-a4b8-78f8f1bdb318','2017-03-25 02:17:07','2017-03-25 02:17:07','84f6227b-6c97-47ff-9ede-d4fbf4994d23','b6160096-c503-4909-a674-7bfbddc8cc45','Janna and Kendall\'s place is really wonderful.  So comfortable.  I plan to book with them again!'),('b21669fb-4888-4997-979a-ac44ddf663b4','2017-03-25 02:17:07','2017-03-25 02:17:07','552b5aaf-33b7-407b-a2dc-459ab730b3a5','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Annie is the ideal host! Anything you need is either already in the condo, or you could easily pick up from the Walmart around the corner or the Walgreens across the street. Annie was also quick with her replies, and if we had needed her for anything we wouldn\'t have hesitated to ask. Because it\'s downtown, street parking was a no-go, which left us to garage parking. If you played your cards right though, it would only be $8 overnight which was still way cheaper than what we had paid before at Waikiki. Make sure you get food before you head back in for the night as well, considering a majority of the places within walking distance close really early- like 6 pm. All in all, the place was super nice, comfortable, and luxurious, we felt safe the entire time and we would definitely stay there again! '),('b269ef4c-5c0c-415c-892d-6e301b121ed0','2017-03-25 02:17:07','2017-03-25 02:17:07','a16c7358-bf66-4802-8933-1616b5a322db','61302be9-4b31-4be0-92fc-d0dda253e167','what a great experience.  Quinn & Hayden were great.  their home was perfect for our needs and exactly as descirbed.  they were also willing to work with us and a few of our specific needs.  i won\'t even look for other AIRbnb\'s next time i\'m in napa, ill just go straight back to Quinn & Hayden.  Thanks!!!!'),('b304c98d-f959-47a4-b92e-4e3e7bac25a2','2017-03-25 02:17:07','2017-03-25 02:17:07','be13aa0e-8da7-4943-be05-5fd89f4d18e6','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Reeva was friendly and the room was fine. Only stayed one night and arrived late but all went well!<BR />'),('b315a08e-e78b-49ff-85ee-20bbd26a0fa2','2017-03-25 02:17:07','2017-03-25 02:17:07','279b355e-ff9a-4b85-8114-6db7ad2a4cd2','7771bbe9-92ab-46d1-a636-864526361d7d','Great place for our visit to Tulane. The walk to campus was an easy one.  The house was clean and well kept. The bed was especially comfortable. '),('b39cd939-e7e5-4e6f-8f45-83a7d04046ca','2017-03-25 02:17:07','2017-03-25 02:17:07','daa15c1b-9ca6-4042-85fd-bdb7a46d5862','150e591e-486b-48ee-be42-4aecba665020','This was a great place to stay! Located in a cool, walkable neighborhood. My only issue was the wireless internet would not connect with any of my devices. There is an Ethernet cable, but unfortunately none of my devices had a port, so it was not very helpful. I did end up exploring some nearby coffee shops as a result since this was a business trip. So this apartment would be ideal if you are looking to \"unplug\" for a little bit. '),('b3b161b0-9ce5-462c-99ff-7d1803d76039','2017-03-25 02:17:07','2017-03-25 02:17:07','4ae40c33-23c9-47a9-b867-0a6d8f25fd8c','7771bbe9-92ab-46d1-a636-864526361d7d','Awesome location! If you\'re ever in Waikiki stay here! You can walk everywhere!!!! The views from the unit are amazing. '),('b409a961-878c-42df-9cda-aef4392e8308','2017-03-25 02:17:07','2017-03-25 02:17:07','4316efa3-0fb1-4aad-87c0-43ef8d3c0376','f9b11370-f316-492c-92da-014d7bce7213','This was my first airbnb experience, and it was an excellent one. My boyfriend and I came here for a laid back anniversary weekend. The setting was lovely and the wine and chocolate was a great touch. The kitchen area was greatly appreciated, as we prefer to be able to cook our breakfasts. The kitchen was nicely stocked with a few pans and even spices (though we brought our own). We did not see the host, however we did see some of the other guests that were staying in different rooms. We were able to come and go as we pleased. The only notable discrepancy I had was the plumbing. The shower would sometimes shut off while in use. It\'s a \'cabin\' of sorts so these types of things are to be expected I feel, so it didn\'t bother me too much. '),('b44b2000-fae1-45a7-99df-62555b9d2524','2017-03-25 02:17:07','2017-03-25 02:17:07','31568a3f-d5b1-47d1-b2ee-74339059e3a0','70b18dcc-08ef-4040-91cf-4075973d320a','The cottage is just as it is pictured. If you are looking for a place to step back in time and relax and do some front porch sitting or spend time with your loved ones, this place is fantastic. <BR />Sharon is very reachable and available to answer any questions.'),('b455e0e4-1a3d-4190-b525-941c3add628d','2017-03-25 02:17:07','2017-03-25 02:17:07','7b8ecd06-c520-4adc-b2e4-bfaa7f8bab2e','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','Great place to stay! Very clean and comfy. '),('b4a5cda2-961d-48a8-9b63-2de5cb8a13a1','2017-03-25 02:17:07','2017-03-25 02:17:07','6ebec357-8589-435b-a5cb-fcd99b638fae','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Elisa was an amazing host, the room was immaculate and very private, I felt right at home. I can\'t say enough about this experience, she though about everything and went above and beyond. \n<BR />Truly amazing! '),('b577df3f-eca8-497e-a95a-bab815fc5860','2017-03-25 02:17:07','2017-03-25 02:17:07','695c0586-3345-4b15-bcf7-f5ecbae258e1','61302be9-4b31-4be0-92fc-d0dda253e167','We really enjoyed our stay at Veronica\'s space! We arrived at around midnight and found the place without any problem, thanks to the direction that she provided. The bedroom and bathroom was newly renovated, modern, and very clean. We stayed for 3 nights to visit the Universal Studio, and it was easy to get there using app-based transportation. There\'s also bus stops right in front of the apartment complex, but we haven\'t got a chance to try it. Such a great value for what we pay! Thank you Veronica!'),('b5786b1f-b980-4224-a397-8a51f77d0858','2017-03-25 02:17:07','2017-03-25 02:17:07','98b1678d-d25c-476a-b6c3-c11978617e90','61302be9-4b31-4be0-92fc-d0dda253e167','Great stay'),('b6648cc9-314f-4ed2-ad47-613a0ea1eacc','2017-03-25 02:17:07','2017-03-25 02:17:07','30e56424-c0f0-4e36-9523-f5e904bb3142','5e181cc6-cac7-49e9-a7a1-3095b0f9010b','Tom and Judy were wonderful hosts! The silver cloud is a perfect place for a couple. They also have a couple additional units within their house! The chicken coop in back, covered seating area, and their sweet cat Jax really added to the experience. Definitely recommend and will be back soon! <BR />'),('b72b2fcf-0dc9-4aef-b2f0-733f3aee7f10','2017-03-25 02:17:07','2017-03-25 02:17:07','84f6227b-6c97-47ff-9ede-d4fbf4994d23','3fda0d5c-fea4-4920-bc91-6e6c6663d161','We really enjoyed our stay! We appreciated how quiet and cozy the cottage was. It was the perfect place to recharge before enjoying all that Eugene has to offer. The hosts were very responsive and helpful.'),('b7383172-b0d3-4317-a4e7-b8d8dc06370d','2017-03-25 02:17:07','2017-03-25 02:17:07','98b1678d-d25c-476a-b6c3-c11978617e90','b6160096-c503-4909-a674-7bfbddc8cc45','Staying with Chris was a great experience. He was flexible and communicative. '),('b7643adf-91e3-4a87-986d-1146c4362045','2017-03-25 02:17:07','2017-03-25 02:17:07','b4d6d884-e50d-41eb-9b97-6395a07a43f9','9eec6c06-5918-4867-833a-face490d4715','This place is a great option next time you are staying in Napa. The hosts are friendly, knowledgeable, and recommended one of the best breakfast dinners ever. The room is comfy, clean, and a great attention to detail. They even have a flashlight next to the bed for emergencies. It was a great stay and we would definitely stay again.'),('b7a56042-8f80-453d-b8c9-94e3903aa65c','2017-03-25 02:17:07','2017-03-25 02:17:07','207f5bf6-d1de-4cca-a60d-c2c48e93debc','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','It was a great place to stay. Lots of room and Jim was very nice. Would stay here again without even thinking about it. '),('b80530d3-6c71-4b6d-ab36-4f8e791fbc6e','2017-03-25 02:17:07','2017-03-25 02:17:07','859a8a8f-9423-4bf6-b471-d9a7f39c9c2c','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Great hosts. Made our trip easy!'),('b8e06e6a-a188-4230-bb02-d2df58ae83dc','2017-03-25 02:17:07','2017-03-25 02:17:07','dbdc349b-a195-474f-9856-dbe01d08c331','85651506-c13c-4c2f-9c79-8fbebc048e39','Very accommodating host, room and amenities were clean and functional, would definitely stay again. '),('b9593356-7fc6-4a30-96c4-30683557dece','2017-03-25 02:17:07','2017-03-25 02:17:07','7ed82a23-cd4f-437b-be12-9c54e84281ef','887dcd8d-d5ee-48de-9626-73ff4ea732fa','I can\'t say enough about this property. My husband and I are frequent airbnbers but only after in-depth study of our needs and hosts offers do I request a booking. Because of this careful matching I usually do tend to come away with favorable reviews.  However, Lynn\'s home surpassed all our expectations in every category. \n<BR />\n<BR />Rather than the 2-bedroom I\'d expected, there were actually 3-bedrooms, so perhaps a prior study has been converted, not sure. But all 3 bedrooms were comfortably decorated. The location was in a great part of town at the end of the drive.  A beautiful, thick wooded area looms beyond the back patio and expansive yard. Having left my TX home in a drought w/threat of wildfires, I was most excited on the evenings I could leave the window raised by my bedside to hear the rain and night sounds.\n<BR />\n<BR />The house was exceptionally clean and had every house appliance, spice, etc you could ever need. In fact, we found several items recently purchased in fridge and counter top '),('b9ce1c05-d100-4fe9-8c06-b50f3b8cb7e6','2017-03-25 02:17:07','2017-03-25 02:17:07','d37d7e5a-d186-45a0-a190-c065ff5922e8','df668e22-e344-4c89-a050-e5ad211cbaa6','Denise\'s place was charming.  It was like a BandB. Everything that was needed was supplied.  Her neighbor was friendly and helpful.  We didn\'t meet Denise as she was having fun in the Canary Islands. :)  She left great instructions and responded quickly to any questions.  Alice was there to take care of anything that needed the personal touch.  There were videos, internet, books, games, toys, extra linen, bathroom essentials. It was decorated in a bright cheerful whimsical style.  Bisbee is a fun town to visit and this place is priced great!'),('b9e70de7-c11f-40dd-823f-bf0eecab1c59','2017-03-25 02:17:07','2017-03-25 02:17:07','4316efa3-0fb1-4aad-87c0-43ef8d3c0376','00e93fc3-53ff-4da4-8e72-faa5216f81bb','It was a cool place. Had a nice kitchen and easy parking on the street. '),('ba2023bd-0ac1-4a69-bf49-8faaa4ca1669','2017-03-25 02:17:07','2017-03-25 02:17:07','e990e07f-1b6f-4bc5-a553-ddddad30211b','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Wonderful home that really helped make our trip. Especially enjoyed the porch! '),('ba2e63d4-edcb-40d9-bc6c-c59bb80dcf2c','2017-03-25 02:17:07','2017-03-25 02:17:07','96fcc267-3257-4260-a264-b3d80639b7c9','00a11245-12fa-436e-9ccc-967417f8c30a','Susan is so thoughtful and accommodating that guests are made to feel welcome and at home. I would definitely recommend her house to fellow travelers. '),('ba31fec1-a877-47cc-bac5-82eb5a8bfec7','2017-03-25 02:17:07','2017-03-25 02:17:07','df2548db-377d-422e-b805-4e8e0c794302','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Kevin is an awesome host. He is very accommodating and also has stuff ready for his guests to eat and drink. The welcome packet was a nice touch, especially for a first time airbnb user like myself. The view is unbelievable as well. I really recommend his place!'),('ba8cc010-8a31-4bfe-8cff-97eeefb1cb3b','2017-03-25 02:17:07','2017-03-25 02:17:07','b33cae89-fe4f-4c6e-a1c5-0022450f2bf2','426624f6-84a9-4ec4-84f3-7655dc70e86e','Great place near Honolulu and Ko-Olina. Right next to the beach. Quiet residential neighborhood. Very thoughtful hosts, espcrially appreciated the cold water and beer in the fridge. Highly recommended to those who want to be away from the typical resort experience.'),('bb4d9640-68a7-4ecf-ba6f-58188fdf3a37','2017-03-25 02:17:07','2017-03-25 02:17:07','dbdc349b-a195-474f-9856-dbe01d08c331','b6160096-c503-4909-a674-7bfbddc8cc45','Jimmy was a wonderful host and the place was comfortable and very close to public transport. '),('bb5da52c-3936-473d-8d19-efebc743eade','2017-03-25 02:17:07','2017-03-25 02:17:07','60b77ea7-04c9-4b8a-b835-dc92c6aa196b','00e93fc3-53ff-4da4-8e72-faa5216f81bb','What a lovely little spot in the world! Perfect location shops, restaurants and beach all with in walking distance. Private and homely feeling with extra touches such as bikes, snorkel and beach gear all provided. Josey\'s handy guide book is also very helpful.'),('bbdb646a-3dc5-4ccf-b175-c96b3e1384d5','2017-03-25 02:17:07','2017-03-25 02:17:07','328bd785-a91b-424c-afda-9e08e5155cfe','426624f6-84a9-4ec4-84f3-7655dc70e86e','This is our 3rd or 4th tim