ation and we were able to find the house easily as the lights were left on for us. We didn\'t have time to meet Carlos or Beia but we had a very comfortable stay. I would recommend staying here.'),('bde66dc5-3e42-4493-aded-246c92526147','2017-03-25 02:17:07','2017-03-25 02:17:07','453b0b1c-6bf3-4e94-8265-082ef06ab85f','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','I absolutely loved my stay here. Bruce was very friendly and the cottage was perfect. I couldn\'t have asked for a better stay. It was so peaceful and the bed was extremely comfy!'),('be39546a-d4ef-4870-acea-500ac27bead1','2017-03-25 02:17:07','2017-03-25 02:17:07','52d726db-2427-40ca-a5f0-d5c117625d1c','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','This place was spectacular. Easy walking distance to southern end of downtown Napa. Ample parking near the home if you needed to drive. The home itself is nestled in the back end of the property and so very quiet. Also since it\'s almost brand new, sound proofing and current design specs make the house very well thought-out in terms of features and amenities. I\'m definitely considering staying here again when I come to Napa for the weekend. Mahalo Jay and Jessica for being such awesome guests with such a lovely little cottage. '),('bee661d0-b53e-4e8b-bc3b-a27d6298d080','2017-03-25 02:17:07','2017-03-25 02:17:07','cb681375-76ad-41d4-ac03-7fe74df9aed3','150e591e-486b-48ee-be42-4aecba665020','Beachwalk Bungalow was an ideal place for our trip to Oahu. Michelle and John were excellent hosts. The location was a quick walk to the beach, as well as other restaurants and shops. The Bungalow had all the amenities you would need (coffee maker, towels, beach chairs and even a baby crib). Kailua is definitely a great laid back town!'),('bf6bda2c-1c72-44fe-8fab-7754824cf4f8','2017-03-25 02:17:07','2017-03-25 02:17:07','d991f849-0f2f-41cb-b6d7-41feee6bc943','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','It was a good trip '),('bf7f6758-190e-4d2c-b3d9-c64b32f6d25e','2017-03-25 02:17:07','2017-03-25 02:17:07','ad124633-a610-483f-862a-6f54dda19c6e','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','I\'ve stayed here twice.  Solid location, comfortable, friendly hosts.'),('bff75b8e-e4cf-4400-90ea-3d0ac0819058','2017-03-25 02:17:07','2017-03-25 02:17:07','8835ba11-7757-45c6-9138-f7e2e4b5f80f','df668e22-e344-4c89-a050-e5ad211cbaa6','Jordan\'s place was exactly what I was looking for in my stay in Kailua. Having a bicycle was great for getting around town.'),('c0311a61-4337-4c33-a9d9-b7a139afeb16','2017-03-25 02:17:07','2017-03-25 02:17:07','38e38612-a626-47a9-a699-05efa178e155','30a890e4-a62c-44f9-abc0-07e2c74021da',' War ok<BR />'),('c10068e3-c90e-4be8-aaf3-74756f877ed3','2017-03-25 02:17:07','2017-03-25 02:17:07','c29b5191-ac68-4e9b-a68f-aa42ea1dcb01','887dcd8d-d5ee-48de-9626-73ff4ea732fa','This place is enjoyably eclectic with the owner\'s art adorning the walls. The house was clean and the bed was comfortable. The location is close to good eating and a variety of clubs in downtown Lafayette. I was in town for a travel seminar after which I walked the few blocks to a really cool beer garden. This place is a gem!'),('c102485d-59a0-4a3d-814b-ef0335fb8e1d','2017-03-25 02:17:07','2017-03-25 02:17:07','9c7d3ecd-9592-4910-bd04-91c59e8350f1','8394fd35-8a8a-479f-a398-48f53b4a6554','Very cute cottage off of a main house in downtown Tupelo. Great location if you want to be near to the downtown and arena. '),('c13c8f6a-d86e-451a-925e-93cd7c8ed9d0','2017-03-25 02:17:07','2017-03-25 02:17:07','817bcb43-ba39-4925-aed6-76be4bed946b','f9b11370-f316-492c-92da-014d7bce7213','JJs place did the job. He\'s a great communicator and we had no issues with the reservation, finding the place or getting in. Warm and cozy room, right next to the bathroom. 10/10 would recommend.'),('c18dfc28-d7d4-48b5-a789-694fd80eefc1','2017-03-25 02:17:07','2017-03-25 02:17:07','38f1bc75-713e-4f09-b02f-d26a4c43ac63','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','It\'s always a pleasure to stay at this house.'),('c2334a