441c-9f8f-3440523fed14','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','The host canceled this reservation 44 days before arrival. This is an automated posting.'),('c865cec7-9e40-4f29-9687-992f34ebfbaa','2017-03-25 02:17:07','2017-03-25 02:17:07','d991f849-0f2f-41cb-b6d7-41feee6bc943','f9b11370-f316-492c-92da-014d7bce7213','Parking was not great limited space.  '),('c86edab4-a60e-4075-8fc6-408739d5d0e5','2017-03-25 02:17:07','2017-03-25 02:17:07','ffcc9c22-759e-4418-b788-81eda89c2865','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','I recommend this place a lot! The bed is wonderful and the hosts are super nice and easy going! They making you feel like home right away! A quiet area for being in a great location in New Orleans :D totally awesome '),('c8855762-7d62-40ec-8f48-b6c531143a35','2017-03-25 02:17:07','2017-03-25 02:17:07','eb3c3877-39bc-4de3-8fc3-4f3895c5b2ba','426624f6-84a9-4ec4-84f3-7655dc70e86e','Emily was a great host! She was very accommodating and always prompt to answer any questions we had. Thank you for making us feel right at home! Look forward to staying again in the future!'),('c89b3636-393e-46df-81ad-1469ed364000','2017-03-25 02:17:07','2017-03-25 02:17:07','d27f17eb-3ddd-44c0-9e8a-f3c21d933b3b','b6160096-c503-4909-a674-7bfbddc8cc45','We had a great stay at Sandra\'s and Val\'s place. They\'re great hosts. Everything was very clean and nice. It was easy to get to the Universal Studios from there. I can just recommend to stay there. Thanks Sandra & Val for the great stay! '),('c8c844e2-bc3f-4f55-8b87-7051c7880036','2017-03-25 02:17:07','2017-03-25 02:17:07','3c7eb6bc-a146-4186-bfbf-9de857286e68','7231eaa1-400f-4cb5-a867-f5eba8adbb81','Bisbee and the night at Naomi and Frank\'s was the serendipitous high-light of our Arizona trip.  We were driving for home in NM and stopped in Tombstone (interesting, kitchsy, don\'t need to do it again) and on the advice of our tour guide decided to swing into Bisbee.  <BR /><BR />Boy, are we glad we did.  We will come back.  <BR /><BR />Some Airbnb research yielded Naomi and Franks place.  Had everything we were looking for and some we didn\'t know about.  <BR /><BR />Space for three, wi-fi, a beautiful Bisbee view.  <BR /><BR />What we didn\'t know was how great it was that it had convenient off street parking. <BR /><BR />Naomi called just minutes after our booking went through and gave us check-in information.  <BR /><BR />Frank met us at the turn in to the house and escorted us to their lovely space.  <BR /><BR />The place was just perfect.  Well furnished, spotlessly clean. Beds comfortable (with extra pillows that we appreciate).'),('c8e07ad6-da02-46a7-9d3f-cd11dee25965','2017-03-25 02:17:07','2017-03-25 02:17:07','acd9cdca-855e-484b-baf9-ffda99d945f2','7231eaa1-400f-4cb5-a867-f5eba8adbb81','The house was amazing! We arrived later than expected but I was able to get in the house with just a code. Cindy and don were very helpful and I will definitely make this trip happen again. '),('ca018781-aaa7-48e1-a03c-be521311d8c8','2017-03-25 02:17:07','2017-03-25 02:17:07','7a958fb6-a203-441c-9f8f-3440523fed14','fa44780d-ac48-41ab-9dd0-ac54a15755cf','Good location to mass transit, affordable'),('ca72c975-f4b1-4960-a331-326fc49ed42e','2017-03-25 02:17:07','2017-03-25 02:17:07','b33cae89-fe4f-4c6e-a1c5-0022450f2bf2','b6160096-c503-4909-a674-7bfbddc8cc45','Michelle\'s place was excellent. The location is in a local area without the tourist noise. The beach you have access to is perfect for watching the sunrise or a quick swim. Michelle herself is very friendly and clearly takes pride in being an Airbnb host. Lots of little extras are available in the space (water, snacks coal for the BBQ etc), we really enjoyed the banana pancake mix provided :)<BR /><BR />So glad we stayed and got to experience a quiet local neighborhood! Highly recommended!'),('cb4b40c3-b6bc-44d8-8331-c9a3d7c7a77c','2017-03-25 02:17:07','2017-03-25 02:17:07','be13aa0e-8da7-4943-be05-5fd89f4d18e6','7771bbe9-92ab-46d1-a636-8645263