e very thorough to make sure we had everything we needed.'),('d0f7375a-33ee-4a47-a4a8-6ea831d36915','2017-03-25 02:17:07','2017-03-25 02:17:07','be89d2ce-231e-4205-a8c1-e6bcf5990302','9eec6c06-5918-4867-833a-face490d4715','The room was cozy and comfortable, in a quiet neighborhood near the light rail. Sequoia was friendly and helpful too! Definitely a great spot with a good value. '),('d1c4cf43-23c5-4eaf-a1b5-9a6bed1777fb','2017-03-25 02:17:07','2017-03-25 02:17:07','ef3f56b8-c024-471e-b7ba-be1a72c6cbec','f9b11370-f316-492c-92da-014d7bce7213','Good location.  Near the University, Mill Street and freeways to get anywhere quickly'),('d2719c31-5aa3-4e56-b31d-ebc9864842ad','2017-03-25 02:17:07','2017-03-25 02:17:07','d37d7e5a-d186-45a0-a190-c065ff5922e8','32c11d3d-99a1-4406-ab41-7b6ccb7dd760','Chill vibe, perfect for pets, great entertainment options (hulu, nextflix, amazon prime, pandora), strong internet, wonderful hot showers, comfortable bed, 2 fenced yards, lots of parking, great laundry service and neighbors (thanks linda!), well maintained and appointed space, charming.'),('d27c40f1-ee07-4d28-a3df-854f64c0235e','2017-03-25 02:17:07','2017-03-25 02:17:07','d72f839c-9390-4085-9d39-b45144c9c3c8','32c11d3d-99a1-4406-ab41-7b6ccb7dd760','A great place to watch the sky without having any light pollution. Nice simple place to rest.'),('d285644c-05ef-4163-a75e-ff84c9ae9a40','2017-03-25 02:17:07','2017-03-25 02:17:07','b4d6d884-e50d-41eb-9b97-6395a07a43f9','9eec6c06-5918-4867-833a-face490d4715','Great place to stay!'),('d3014b29-0f9d-469b-a12d-f129866a6ead','2017-03-25 02:17:07','2017-03-25 02:17:07','a12e6da9-0797-4445-9626-d5f0fa5ed775','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','Terry and Sarah\'s Windmill guest house is a great place to relax in the peaceful setting of Montevallo. There was much to explore and do in the surrounding area, or enjoy the amenities of the home with some Bach on the stereo system.  I would be happy to stay at Terry and Sarah\'s guest house again. '),('d3206cc7-86d7-4a0b-bcd7-700e9802f973','2017-03-25 02:17:07','2017-03-25 02:17:07','e74201c2-6057-419d-be22-d0087eeb4179','dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08','Sherry is a fantastic person, she cares about people and goes the extra mile in making ones stay comfortable. My flight was delayed and I got there at 1:30 A.M., she welcomed me with a cheer. I was there on a 2 day weekend business trip and had very little time to see around. She loaned me beach slippers and a beach towel when I went to Waikiki Beach!! Her home is in a beautiful upmarket neighborhood and is very nice. I would definitely recommend staying here.'),('d3ce5820-b74a-48de-a483-033341c3f9df','2017-03-25 02:17:07','2017-03-25 02:17:07','d27f17eb-3ddd-44c0-9e8a-f3c21d933b3b','3fda0d5c-fea4-4920-bc91-6e6c6663d161','Home is clean, good facilities, comfortable bed and hosts are friendly. It is treated like a hostel, so the hosts are not around aside from check-in or to clean. Strange having a full service kitchen but being unable to use it, although this is mentioned in the listing. The location, although most likely safe, is very residential and not confidence inspiring for tourists, especially those reliant on public transport. Paper is also requested to not be flushed down the toilet and to be placed in a bin instead in the shared bathroom, which is both strange and uncomfortable.'),('d405b479-8895-4dca-a9b7-5fb00654c4e5','2017-03-25 02:17:07','2017-03-25 02:17:07','52d726db-2427-40ca-a5f0-d5c117625d1c','7771bbe9-92ab-46d1-a636-864526361d7d','Just as listed. Jay was a great host to my in-laws and they had a fantastic time. '),('d41ea0a5-32a3-49c9-819b-2e20de71bcca','2017-03-25 02:17:07','2017-03-25 02:17:07','207f5bf6-d1de-4cca-a60d-c2c48e93debc','7771bbe9-92ab-46d1-a636-864526361d7d','Beautiful old southern home, very spacious accommodations including private lounge, separate bedroom large bath and kitchenette.  Close to downtown, private & secure.  '),('d458ae89-2c7e-4007-a7e2-df6c8e4a1b5e',