ly quiet, tranquil, a genuinely friendly neighbor Linda, we loved the fenced in front and back yards for our dog (he is very picky too and seemed at home immediately!). The bed was comfy, the shower nice and hot (important for me!), after all our adventures we were able to relax in the living room as if it was our own and watch an obscure movie on Netflix, great wifi, great cell phone reception (who would think in the middle of a copper mine??). We didn\'t do any cooking, but were tempted by the gas stove, and did enjoy the comfort of fresh ground coffee because how did t'),('dcc77ae5-fb82-4314-bc4b-3db267bd5ac6','2017-03-25 02:17:07','2017-03-25 02:17:07','daa15c1b-9ca6-4042-85fd-bdb7a46d5862','f33e2624-520b-4bc2-b6a0-190ee1d41855','Mike\'s place was perfect for our short trip to the cities. Clean, comfortable, and the perfect distance to restaurants and the Xcel Energy Center!'),('dd4f2ff1-1385-4fec-8d32-f0b11d85bb49','2017-03-25 02:17:07','2017-03-25 02:17:07','43803445-1874-4a3c-94e9-955fcb25089b','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','This place is so cozy and we\'ll decorated. Valerie and Spencer were both very freindly and informative. We really enjoyed our stay. '),('dd8967a1-4517-44ab-9991-a49b9ed9d7bd','2017-03-25 02:17:07','2017-03-25 02:17:07','9c7d3ecd-9592-4910-bd04-91c59e8350f1','887dcd8d-d5ee-48de-9626-73ff4ea732fa','Chris was super helpful with the house and extremely gracious about our privacy.  The listing was as advertised, and it was extremely close to down-town Tupelo, making it easy to walk to dinner and stroll around.  We loved it!'),('ddf248ee-62f0-4bda-ae0c-1bfff7ddc4a4','2017-03-25 02:17:07','2017-03-25 02:17:07','e2d4feeb-4cb0-4df4-a10e-5a54748621b3','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Lovely refurbished Tudor style home.  Very welcoming and inclusive hosts.  The breakfast was all homemade and fabulous.  This was a great place to stay.'),('de9be2f6-a40e-4419-b321-f49711f8d155','2017-03-25 02:17:07','2017-03-25 02:17:07','78ca76e7-78d