en care of, we just settled in and enjoyed our weekend. If you prefer a qui'),('e0770c00-988d-4c04-9b7c-5ec68fd704aa','2017-03-25 02:17:07','2017-03-25 02:17:07','32945f6e-5a96-4233-b8ae-048d51323d7b','887dcd8d-d5ee-48de-9626-73ff4ea732fa','The hotel outside looks a little older, the room was cute, though.  Had great shower pressure, AC worked wonderfully, room was clean, and had all the toiletries.  Beds were also very comfortable. '),('e0c8454d-591f-4365-af19-a76c4d2f6b9e','2017-03-25 02:17:07','2017-03-25 02:17:07','859a8a8f-9423-4bf6-b471-d9a7f39c9c2c','8394fd35-8a8a-479f-a398-48f53b4a6554','The pool house was a very nice place to stay. Brent and Cindy are very accommodating. Highly recommended!'),('e2baf0b9-3bc9-4525-8616-323d01178256','2017-03-25 02:17:07','2017-03-25 02:17:07','aaf389be-c794-4fb4-a6cf-619ca956898f','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','The cottage was beautiful and was stocked with everything anyone could possibly need for a comfortable stay. The neighborhood was quiet and away from busy streets and at the same time a conveniently short distance from many great restaurants, markets, and wineries. This is a great place to stay if you are traveling solo or with a significant other; the cottage is very intimate.'),('e327d2a5-651c-4ba8-8dea-2098483e481d','2017-03-25 02:17:07','2017-03-25 02:17:07','df2548db-377d-422e-b805-4e8e0c794302','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','Very nice. Such a cute place to stay. Kevin was great! Was quite and has a beautiful view of the city at night. We loved it. '),('e32a3a30-4565-4628-8d9f-6def81f7f97c','2017-03-25 02:17:07','2017-03-25 02:17:07','e979e012-bcb1-47ea-bb39-140cdfe0f917','30a890e4-a62c-44f9-abc0-07e2c74021da','Clean and comfortable! '),('e3552d9e-a604-462d-98c2-3b1b84411efa','2017-03-25 02:17:07','2017-03-25 02:17:07','b4a927e4-9715-4cd2-9918-47491f97df3e','61302be9-4b31-4be0-92fc-d0dda253e167','Great place and great people!  '),('e3fbbb5f-e399-4b2f-afa5-7ec6bf9040c3','2017-03-25 02:17:07','201