),('e5c48592-18f1-4739-9d72-bcf781c48dec','2017-03-25 02:17:07','2017-03-25 02:17:07','4703b2d8-e417-4243-a6f3-044fc06f020e','85651506-c13c-4c2f-9c79-8fbebc048e39','I felt right at home here, Amelia was so welcoming! I was lucky enough to be invited to join a delicious home cooked dinner with her and her other guest. It was a great environment to hang out with new people and also have some quiet time. Amelia is great to talk to and to learn from about what\'s going on in the area. Close to Birmingham which I unfortunately didn\'t get to explore this time around.'),('e62d302a-2bc0-4381-8a28-08503d9aac01','2017-03-25 02:17:07','2017-03-25 02:17:07','e6c33577-5de3-4481-9147-47ef4710b986','00e93fc3-53ff-4da4-8e72-faa5216f81bb','Joanna and her family are beautiful people. They are eager to share their stories of their lives, travels, Hawaii past and current, and the rich Hawaiian culture with you. I honestly felt like one of there family members while staying with them. They even fed me a delicious BBQ dinner. This is a great way to experience the loving nature of the Hawaiian people. '),('e66c3e16-571b-4200-8c02-cfce1103db33','2017-03-25 02:17:07','2017-03-25 02:17:07','817bcb43-ba39-4925-aed6-76be4bed946b','85651506-c13c-4c2f-9c79-8fbebc048e39','Tom was a great host, super friendly! Plus his dog Coby is so sweet. Good place for the price! Everything offered was there! '),('e6cfc956-c5a7-47a7-9aa6-454f22341af4','2017-03-25 02:17:07','2017-03-25 02:17:07','3827c1d1-14d5-4643-a24b-3dca656192fa','9e7b2291-3bff-43b9-9241-8ff685e7a6dd','Very clear place.'),('e6d47691-f4be-4f26-989b-bf99c3b853e4','2017-03-25 02:17:07','2017-03-25 02:17:07','0675a2d6-f64c-4be7-9a8a-f55341f09d4b','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Cozy place, great host. '),('e744bff1-cc32-4a8b-ab38-8545bdbdf8fc','2017-03-25 02:17:07','2017-03-25 02:17:07','aaf389be-c794-4fb4-a6cf-619ca956898f','7771bbe9-92ab-46d1-a636-864526361d7d','This lovely little guest studio behind Melanie\'s house was the perfect choice for our visit to Napa/Sonoma. As others have commented, it is cozy but very well-appointed with everything you could possibly need for a lovely stay. Bed was very comfortable. Melanie greeted us warmly with a smile and a hug and was very responsive to any inquiries we had.  The location was perfect for our jaunts to Napa for the wine train and a day trip to Calistoga. This is the epitome of an AirBnB stay......'),('e7f4c843-1952-4d7d-ac87-866bedeb2bbb','2017-03-25 02:17:07','2017-03-25 02:17:07','b13b1a74-3a12-4f00-8c19-273cbedc0eaa','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','Very nice place,  but just couple notes-pretty serious stairclimb, good workout though! Smells smokey, smoker friendly. That\'s the main thing our group didn\'t care for. Other than that, nice place, well appointed. Great location and view, not loud. '),('e8146cd3-2224-40d3-874e-94216e106514','2017-03-25 02:17:07','2017-03-25 02:17:07','e979e012-bcb1-47ea-bb39-140cdfe0f917','91e27a07-1f47-43c9-b851-60c6882abcd3','Great host.  Clean and super friendly.  Fun dog to love on.  Very thoughtful host.'),('e8450beb-0727-4148-b9f9-a7460e2531c6','2017-03-25 02:17:07','2017-03-25 02:17:07','6ebec357-8589-435b-a5cb-fcd99b638fae','aa92d1ff-f0ad-4ba3-9c20-2afef207bf70','Elisa was kind and communicative. She left breakfast out which was an amazing detail! Also, Elisa has the most amazing pillows in the room! Highly recommend!'),('e84e4ec9-64ec-4512-a27d-a7b590ada6ee','2017-03-25 02:17:07','2017-03-25 02:17:07','6ebec357-8589-435b-a5cb-fcd99b638fae','150e591e-486b-48ee-be42-4aecba665020','Staying at Elisa\'s house was amazing! The large room and super comfortable bed made our big drive easy to recover from. <BR /><BR />The coffee and scones in the morning was a great bonus too! Thanks for a good stay!'),('e88b2d64-c23d-4c1b-9776-211ab7235c91','2017-03-25 02:17:07','2017-03-25 02:17:07','18ff54e2-dc10-4e7f-bfdb-8a7591f7f009','61302be9-4b31-4be0-92fc-d0dda253e167','There are two other rooms that get rented ou