 experience.  The family was nice and generous.  The street parking was full so they offered their garage.  If I needed to go back to Fremont, I would book it again.'),('ea8b5ac8-c518-4ac3-aca2-b73a9d774f20','2017-03-25 02:17:07','2017-03-25 02:17:07','78ca76e7-78dc-4867-8281-50ab3dc47cdd','f33e2624-520b-4bc2-b6a0-190ee1d41855','Small and relaxing. Cozy and comforting.'),('ead4adc8-07ed-492e-8fed-a6421cce171e','2017-03-25 02:17:07','2017-03-25 02:17:07','328bd785-a91b-424c-afda-9e08e5155cfe','cf1780e6-d294-4113-8749-1c728b9e3f81','Old house that is remodeled. Nice bedroom with comfortable bed. We enjoyed our stay. '),('eb78caf9-de6a-4a18-8961-52bec8c4c320','2017-03-25 02:17:07','2017-03-25 02:17:07','836bea96-c22d-46d2-9335-b97cec4cc30a','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Ellen is a super hostesses. All the southern charm of Jackson with great art and atmosphere. Comfortable home in the heart of Jackson.'),('eb7a2c08-d5b5-47f4-8f6b-58b9105dc94e','2017-03-25 02:17:07','2017-03-25 02:17:07','52cc10db-af9b-499c-aa8e-670056611a7c','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Kelly\'s place was very affordable, and was exactly as advertised! '),('ec2750e9-9b0a-49d9-b2ef-77898aded427','2017-03-25 02:17:07','2017-03-25 02:17:07','817bcb43-ba39-4925-aed6-76be4bed946b','dfed3ea3-c133-47e8-8cfa-312eecbcc56d','JJ is easy to get in touch with and offers a quiet place to sleep and take a shower. The lava lamp really lives up to the hype.'),('ec299be8-75d4-4dee-a4f7-ce30dc7409a6','2017-03-25 02:17:07','2017-03-25 02:17:07','ad4cd1fe-3358-4183-8062-59e39824175c','3fda0d5c-fea4-4920-bc91-6e6c6663d161','An absolute perfect step back into time. '),('ec3be7c6-867e-4863-acc9-aecacb272fd3','2017-03-25 02:17:07','2017-03-25 02:17:07','7354ea6c-3c0e-4800-aad8-708c29a6c067','c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e','Not very clean, but it is a good value. Tex was very accommodating to our early check-in and late check-out, which we really appreciated. '),('ed4dade8-cd64-4525-8687-9cf2bf9af980